INSERT INTO `oxartextends` (`OXID`, `OXLONGDESC`, `OXLONGDESC_1`, `OXLONGDESC_2`, `OXLONGDESC_3`, `OXTIMESTAMP`) VALUES ('0074844219db7a3d3f06e342be315a99','','','','','2022-11-22 10:45:13'),('009b3c99d864df38ff9d5d5723f16dd1','','','','','2022-11-22 10:06:53'),('00f61f94d3858cbb9b54c01c13fcbee1','','','','','2022-11-22 10:44:07'),('017bd234dcfa2450d7a731e3df766d88','','','','','2022-11-22 10:09:15'),('01a3dcf352721121bf102ae2d3319abb','','','','','2022-11-22 10:06:04'),('01df9a70311d07273e173809495ec572','','','','','2022-11-22 10:10:04'),('0223778691bfb64725bb485fb31a59e2','','','','','2022-11-22 10:44:07'),('062b2914d57389263ae7bdd773c70f4a','Lubsy Haileys, ein Klassiker und ein absolutes Must-have für jeden Kleiderschrank. Dieses oversized T-Shirt aus 100% Biobaumwolle präsentiert sich mit kurzen Ärmeln, einem Rundhalsausschnitt und seiner stylischen Brusttasche. Tragen Sie es lässig separat oder unter einem Hemd.\r\n','Lubsy Haileys, a classic and an absolute must-have for every closet. This oversized t-shirt made of 100% organic cotton presents itself with short sleeves, a round neck and its stylish chest pocket. Wear it casually separately or under a shirt. ','','','2023-03-24 08:57:01'),('066e3ce119c43c81cc0e46d4f1681eed','SamLaPelle – Destiny, unser Handgepäckkoffer, der nicht nur gut aussieht, sondern zusätzlich noch jede Menge praktische Features hat!\r\nHergestellt aus einem hochwertigen deutschen Premium Polycarbonat, das nahezu vollkommen bruchfest ist. Mit einem Fassungsvolumen von 33 L ist er der perfekte Kabinen Trolley und erfüllt mit seinen Maßen die Standard-Richtlinien für Handgepäck. Ein absolutes Must-Have für alle Reiseliebhaber!','SamLaPelle - Destiny, our carry-on suitcase that not only looks good, but additionally has a lot of practical features! Made of a high quality German premium polycarbonate, which is almost completely unbreakable. With a capacity of 33 L, it is the perfect cabin trolley and its dimensions meet the standard guidelines for hand luggage. An absolute must-have for all travel lovers!','','','2023-03-24 11:59:58'),('070b1d3dc47b731833dfb1c0ec2e01e9','','','','','2022-11-22 10:36:30'),('0757c381b5c2efea14b10d34822c67ed','Bei OXID eMotors finden Sie die perfekte Ersatz-Tür für ihren OX7 Coupé. Mit unsere Tür bekommen Sie einen qualitativen und hochwertigen Ersatz.  Mit ihrem extra Robusten Material, gewährleisten wir eine lange Lebensdauer. ','','','','2023-03-24 13:32:10'),('07b7fb4cb0c1b6531aa97c7ef99ad2e7','','','','','2022-11-22 10:45:48'),('096189a7a9ad91fbd56e4a3f90167b04','Entdecken Sie jetzt unsere exklusiven Felgen und verleihen Sie Ihrem Fahrzeug ein einzigartiges und stilvolles Aussehen! - R9 Grande Luca\r\n\r\nUnsere Felgen werden aus hochwertigen Materialien hergestellt und unterliegen strengen Qualitätskontrollen, um Ihnen die beste Performance und Sicherheit auf der Straße zu bieten. Mit unseren Felgen verbessern Sie nicht nur die Optik Ihres Fahrzeugs, sondern auch dessen Fahreigenschaften, indem Sie das Gewicht reduzieren und die Traktion erhöhen.\r\n','','','','2023-03-28 07:22:10'),('0c3f2bcfc3320dda671565f3595e5029','','','','','2022-11-22 10:08:25'),('0f4ab0b7b44c8187181470d7890714a6','','','','','2022-11-22 10:44:50'),('10cc6c01da168fa86c1dc16fd1effb69','Unsere SamLaPelle – Butterfly ist mit ihren bunten, fröhlichen Farben ein echter Hingucker!\r\nDurch ihre geschickte Aufteilung ermöglicht sie nicht nur die Mitnahme der wichtigsten Utensilien, sondern hat auch Platz für mehr. Mit ihrem verstellbaren Schultergurt kann die SamLaPelle – Butterfly lässig an der Schulter oder bequem über dem Körper getragen werden.\r\nFreuen Sie sich auf bunte Komplimente!\r\n','Our SamLaPelle - Butterfly is a real eye-catcher with its bright, cheerful colors! Due to its clever division, it not only allows you to take along the most important utensils, but also has room for more. With its adjustable shoulder strap, the SamLaPelle - Butterfly can be worn casually on the shoulder or comfortably across the body. Look forward to colorful compliments! ','','','2023-02-24 12:34:05'),('10d5ed695f5e452b178af9cfcfb1ea2b','','','','','2022-11-22 10:36:12'),('10ebffe926b594b58d339fb12c41e890','','','','','2022-11-22 10:36:56'),('11ef2747d60a8de0f430452aa1fa6348','Die Hyper HS 16 2-Wege-Marine-Lautsprecher bieten eine hervorragende räumliche Klangabbildung. Der Hochtöner deckt den hohen Frequenzbereich ab, während der Tief- und Mitteltöner die niedrigen Frequenzen übernimmt. Das System ist kompakt und benötigt keine weiteren Support-Geräte. Für den Einbau der Hyper HS 16 Lautsprecher wird nur wenig Platz im Fahrzeug benötigt. ','','','','2023-03-24 14:28:51'),('1574d80473f64f9d73a295da4482aecd','','','','','2022-11-22 10:09:47'),('15d7c73d18d8a2aa7494cb4b29b65c6d','Unsere Amber Damen Sonnenbrille ist mit ihrem eleganten und femininen Design ein optisches Highlight. Dieses Modell überzeugt mit seiner intensiven Farbgebung in transparentem Bernstein braun kombiniert mit braunen Linsen. Außerdem verleiht sie durch ihre leicht quadratische Glasform einen markanteren und extravaganten Look.Lassen Sie sich diese Chance zum perfekten Accessoire nicht entgehen!','Our Amber women\'s sunglasses are a visual highlight with their elegant and feminine design. This model convinces with its intense color scheme in transparent amber brown combined with brown lenses. It also gives a more striking and extravagant look with its slightly square lens shape.','','','2023-03-24 10:52:39'),('16acb97e3eb74b9de0f0d5395528bc25','','','','','2022-11-22 10:44:29'),('181eaea488198535f1af1542acc8696f','Unser Ersatz-Stoßfänger für Ihren OX7 Coupé - der aus hochwertigen Materialien hergestellt ist, und Langlebigkeit und Widerstandsfähigkeit garantiert. Mit seinem Design und Form ist unser Stoßfänger so gestaltet, dass er den Luftwiderstand minimieren und somit den Kraftstoffverbrauch Ihres Fahrzeugs reduzieren kann. Ein Stoßfänger mit dem Sie reibungslos und effizient auf der Straße unterwegs sein können.  ','','','','2023-03-28 07:51:03'),('18dc6eeaf977fc692e4007908a5ec647','Unser Ersatz-Stoßfänger für Ihren OX5 Family SUV - der aus hochwertigen Materialien hergestellt ist, und Langlebigkeit und Widerstandsfähigkeit garantiert. Mit seinem Design und Form ist unser Stoßfänger so gestaltet, dass er den Luftwiderstand minimieren und somit den Kraftstoffverbrauch Ihres Fahrzeugs reduzieren kann. Ein Stoßfänger mit dem Sie reibungslos und effizient auf der Straße unterwegs sein können. ','','','','2023-03-28 07:50:49'),('18ded1d8b3ae20248111467da7f98d1b','','','','','2022-11-22 10:04:43'),('197febbad78d780a7dd76c60235ec399','','','','','2022-11-22 10:45:48'),('19ea60f0a57483a2a30a77baccb8cd72','Der digitale Tachometer besteht aus hochwertigen Materialien und ist dadurch besonders langlebig. Zudem ist der Tachometer Race besonders präzise und zuverlässig, dank der genauen Ablesbarkeit sind auch bei schlechten Lichtverhältnissen die Angaben leicht ablesbar. ','','','','2023-03-24 15:55:16'),('1a428e52cef255c68f6c89a5a6e10f6e','','','','','2022-11-22 10:45:48'),('1af9cb1b77345dbac074c2c024ad483d','','','','','2022-11-22 10:45:13'),('1d4d766144e677f7e5bf3e3e091142a7','','','','','2022-11-22 10:45:48'),('1f5aa6489f1767053f65b70def60e385','','','','','2022-11-22 10:44:29'),('1ffcc31548f4c70094dc854d899af778','','','','','2022-11-04 15:05:38'),('20eb1d0da50bef36e36e68ca86722116','','','','','2022-11-22 10:44:50'),('22007e30fe1e3df513b9ac70527a2cd8','','','','','2022-11-22 10:44:07'),('22e135eb03a3aa69198ae30762ee785c','Ob zum Fahrradfahren, Golfspielen oder einfach nur um die Sonne zu genießen – unsere Ocean eyes polarisierte Sport Sonnenbrille lässt dich nie im Stich. Durch die gekurvten polarisierten Gläser sind Ihre Augen bestmöglich geschützt und der klassische Look macht diese Brille auch außerhalb des Sports tragbar. Dank ihres universellen Designs ist unsere Ocean eyes Sonnenbrille für Damen und Herren geeignet.','Whether you\'re biking, golfing or just enjoying the sun, our Ocean eyes polarized sports sunglasses will never let you down. The curved polarized lenses provide the best possible protection for your eyes, and the classic look makes these glasses wearable outside of sports as well. Thanks to their universal design, our Ocean eyes sunglasses are suitable for both men and women.','','','2023-03-24 10:52:17'),('24c94a0412114be5aba084ae018f9cfa','','','','','2022-11-22 10:44:29'),('277e9b50ea59ed39a48feb8b5e2a9f7f','Querlenker stabilisieren das Auto und sind für die Ausrichtung der Räder verantwortlich. Ist Ihr Querlenker defekt, spüren Sie die Auswirkungen sofort beim Fahren. Wenn Ihr Auto die Spur nicht richtig hält oder Sie eine unausgeglichene Abnutzung der Reifen feststellen ist es Zeit für einen neuen Querlenker!\r\nDer Querlenker Aluminium von OXID eMotors sorgt für ein präziseres Lenkverhalten und weniger ungefederte Masse. Das führt zu einem besseren Handling Ihres Fahrzeugs. Er sorgt für ein gutes Fahrgefühl und ist 44% leichter als ein Stahllenker. Der Querlenker Aluminium zeichnet sich durch seine exzellente Qualität und Verarbeitung aus, was ihn zudem besonders langlebig macht.','','','','2023-03-24 13:38:34'),('285c7c94d12232b324b2c54e714755c4','','','','','2022-11-22 10:44:50'),('2947ba94e98658dbd61cf72e593c97fb','','','','','2022-11-22 10:45:13'),('29da31ad83e8f6b480d0c096e9a501c2','','','','','2022-11-22 10:44:50'),('29ffeed6ad695855b395bb3cfdffb20e','','','','','2022-11-22 10:08:03'),('2a101970f2a89c2a933c756bbd59782a','Foto: \"<a href=\"https://ccnull.de/foto/haengeregister-kunden/1007190\" target=\"_blank\">Hängeregister KUNDEN</a>\" von <a href=\"https://ccnull.de/fotograf/tim-reckmann\" target=\"_blank\">Tim Reckmann</a> via <a href=\"https://ccnull.de\" target=\"_blank\">ccnull.de</a>, <a href=\"https://creativecommons.org/licenses/by/2.0/de/\" target=\"_blank\">CC-BY 2.0</a>','Photo: \"<a href=\"https://ccnull.de/foto/haengeregister-kunden/1007190\" target=\"_blank\">Hängeregister KUN