INSERT INTO `oxcategories` (`OXID`, `OXPARENTID`, `OXLEFT`, `OXRIGHT`, `OXROOTID`, `OXSORT`, `OXACTIVE`, `OXHIDDEN`, `OXSHOPID`, `OXTITLE`, `OXDESC`, `OXLONGDESC`, `OXTHUMB`, `OXTHUMB_1`, `OXTHUMB_2`, `OXTHUMB_3`, `OXEXTLINK`, `OXTEMPLATE`, `OXDEFSORT`, `OXDEFSORTMODE`, `OXPRICEFROM`, `OXPRICETO`, `OXACTIVE_1`, `OXTITLE_1`, `OXDESC_1`, `OXLONGDESC_1`, `OXACTIVE_2`, `OXTITLE_2`, `OXDESC_2`, `OXLONGDESC_2`, `OXACTIVE_3`, `OXTITLE_3`, `OXDESC_3`, `OXLONGDESC_3`, `OXICON`, `OXPROMOICON`, `OXVAT`, `OXSKIPDISCOUNTS`, `OXSHOWSUFFIX`, `OXTIMESTAMP`) VALUES ('066dc9023c7be279e26277a0849ea1aa','07020609d573666017cd883d078e47ac',16,17,'07020609d573666017cd883d078e47ac',0,1,0,1,'Koffer','Koffer für jeden Anlass und in verschiedenen Größen','Entdecken Sie die perfekten Koffer für Ihre Reiseabenteuer! Unser Sortiment bietet eine Vielzahl von hochwertigen Koffern in verschiedenen Größen, Farben und Designs, um Ihren individuellen Bedürfnissen gerecht zu werden.\r\n\r\nUnsere Koffer bestehen aus strapazierfähigen Materialien und sind auf Langlebigkeit ausgelegt, damit Sie jahrelang Freude an Ihrem Reisebegleiter haben. Mit praktischen Features wie Teleskopgriffen, Rollen und zahlreichen Fächern, bieten unsere Koffer maximale Flexibilität und Komfort beim Reisen.\r\n\r\nEgal ob Sie einen Wochenendtrip oder eine längere Reise planen, wir haben den perfekten Koffer für Sie. Wählen Sie aus verschiedenen Größen, um sicherzustellen, dass Sie all Ihre notwendigen Reiseutensilien bequem und sicher transportieren können.\r\n\r\nZusätzlich zu ihrer Funktionalität sind unsere Koffer auch stilvoll und elegant. Mit einer Vielzahl von Farben und Designs, können Sie sicher sein, dass Ihr Koffer auf dem Gepäckband auf dem Flughafen auffällt.\r\n\r\nAlso, worauf warten Sie noch? Finden Sie jetzt den perfekten Koffer für Ihre Reise und machen Sie sich bereit für unvergessliche Abenteuer!\r\n\r\n','','','','','','','',0,0,0,1,'Suitcases','','',0,'','','',0,'','','','koffer_2a.png','',NULL,0,1,'2023-03-24 09:08:28'),('07020609d573666017cd883d078e47ac','oxrootid',1,18,'07020609d573666017cd883d078e47ac',0,1,0,1,'Merchandise','','','','','','','','','',0,0,0,1,'Merchandise','','',0,'','','',0,'','','','','',NULL,0,1,'2023-02-24 12:04:15'),('2b6711be251807f1bd0fa5b9e03398e2','07020609d573666017cd883d078e47ac',2,3,'07020609d573666017cd883d078e47ac',0,1,0,1,'Handtaschen','','Handtaschen sind ein unverzichtbares Accessoire. Sie dienen nicht nur zum Verstau von persönlichen Gegenständen, sondern sind auch ein Ausdruck des persönlichen Stils und Geschmacks. Bei uns finden Sie Handtaschen in allen Größen und Materialien. Stöbern Sie durch unser Handtaschensortiment und treffen für sich die richtige Wahl!','','','','','','','',0,0,0,1,'Handbags','','',0,'','','',0,'','','','handtasche_2a.png','',NULL,0,1,'2023-03-23 14:20:38'),('444309285d0a9e5a95a0c8978238624a','07020609d573666017cd883d078e47ac',4,5,'07020609d573666017cd883d078e47ac',0,1,0,1,'Regenschirme','','Ein Regenschirm, ein praktisches Accessoire und ein modisches Statement zugleich. Sie sind ein unverzichtbares Accessoire für jedes Wetter und schützen vor Nässe und Wind. Mit der richtigen Wahl kann man sich vor unangenehmen Wetter schützen und gleichzeitig stilvoll und praktisch auftreten. Finden Sie für sich den perfekten Regenschirm!','','','','','','','',0,0,0,1,'Umbrellas','','',0,'','','',0,'','','','regenschirm_1b.png','',NULL,0,1,'2023-03-23 14:42:04'),('48fbdd072dc945d7d354bf71ca09daf8','oxrootid',1,2,'48fbdd072dc945d7d354bf71ca09daf8',0,1,0,1,'Fahrzeuge','','','','','','','','','',0,0,0,1,'Vehicles','','',0,'','','',0,'','','','','',NULL,0,1,'2023-02-24 12:04:16'),('56bda64236d411c3709eff8733785ee6','ddf8b64379df19b79b960854f2b9abd2',12,13,'ddf8b64379df19b79b960854f2b9abd2',0,1,0,1,'Räder','Felgen und Reifen für den Rad- oder Reifenwechsel','Je nachdem ob Sie einen Rad- oder einen Reifenwechsel planen, benötigen Sie unterschiedliche Teile bzw. Komponenten und müssen auch auf verschiedene Dinge achten. \r\n\r\nFür einen Radwechsel brauchen Sie bestimmtes Werkzeug. Dazu gehören z.B. ein Wagenheber, ein Radkreuz und der Schlüssel für das Felgenschloss, falls Ihr Fahrzeug ein solches hat. Außerdem brauchen Sie Radschrauben oder -muttern. Sie sollten in jedem Fall überprüfen ob die Mindestprofiltiefe der Reifen gegeben ist, sollte dem nicht so sein, machen Sie einen Reifenwechsel! Beim Reifenwechsel wird ein anderer Reifen auf die Felge gezogen. \r\n','','','','','','','',0,0,0,1,'Wheels','','',0,'','','',0,'','','','autoreifen_1.png','',NULL,0,1,'2023-03-27 14:20:06'),('65c6274caafeaf6da50dc2bd41339e1f','ddf8b64379df19b79b960854f2b9abd2',10,11,'ddf8b64379df19b79b960854f2b9abd2',0,1,0,1,'Karosserie','Verlässliche Ersatzteile für die Karosserie','Die Karosserie besteht aus zahlreichen Komponenten, die allesamt wichtige Teile des Sicherheitssystems Ihres Fahrzeugs sind. Zu den Karosserieteilen gehören z.B. die Motorhaube, der Stoßfänger, die Beleuchtungskörper und Scheinwerfer sowie auch die Fenster und Türen. Die Gemeinsamkeit dieser Komponenten: sie alle schützen den Fahrer und die Fahrzeuginsassen vor äußeren Einflüssen und sorgen dafür, dass das Auto unabhängig von der Tageszeit, den Wetterbedingungen oder der Straßenbeschaffenheit problemlos genutzt werden kann. \r\n\r\nFür eine sichere Fahrt sollte die Karosserie regelmäßig gewartet und die einzelnen Teile gereinigt werden. Bei Defekten können Sie sich auf das Ersatzteilsortiment von OXID eMotors verlassen – bei uns finden Sie eine Bandbreite an von Autoherstellern empfohlenen Karosseriekomponenten.\r\n','','','','','','','',0,0,0,1,'Chassis','','',0,'','','',0,'','','','autotr_1.png','',NULL,0,1,'2023-03-27 14:17:50'),('6f265749cbd4cd26f5d358b09a5e862b','07020609d573666017cd883d078e47ac',6,7,'07020609d573666017cd883d078e47ac',0,1,0,1,'Uhren','Entdecken Sie jetzt unsere große Auswahl an Uhren','Lassen Sie sich von unseren stilvollen Uhren begeistern und geben Sie Ihrem Look das gewisse Extra! Unsere Uhrenkollektion bietet eine breite Auswahl an verschiedenen Modellen für jeden Geschmack und jede Gelegenheit.\r\n\r\nUnsere Uhren bestehen aus hochwertigen Materialien und sind präzise gefertigt, um Ihnen eine hohe Qualität und Langlebigkeit zu bieten. Mit einem breiten Spektrum an Designs, Farben und Stilen finden Sie bei uns garantiert die perfekte Uhr für Ihr Outfit.\r\n\r\nOb Sie einen klassischen, eleganten Look bevorzugen oder etwas sportlicheres suchen, unsere Uhren sind die perfekte Ergänzung für jeden Stil. Mit verschiedenen Funktionen wie Datumsanzeige, Stoppuhr und Wasserdichtigkeit sind unsere Uhren sowohl praktisch als auch modisch.\r\n\r\nUnsere Uhren sind auch das perfekte Geschenk für einen besonderen Anlass. Egal, ob Sie Ihrem Partner, einem Familienmitglied oder einem Freund eine Freude bereiten möchten, unsere Uhren sind das perfekte Geschenk für jeden, der stilbewusst ist und eine hohe Qualität zu schätzen weiß.\r\n\r\nGönnen Sie sich jetzt eine unserer stilvollen Uhren und setzen Sie ein Statement mit Ihrem Look. Wir garantieren Ihnen höchste Qualität und zufriedenstellende Kauferlebnisse.\r\n','','','','','','','',0,0,0,1,'Watches','','',0,'','','',0,'','','','uhr_2.png','',NULL,0,1,'2023-03-24 09:23:36'),('84483a28045286f878a5145a0e293082','07020609d573666017cd883d078e47ac',8,9,'07020609d573666017cd883d078e47ac',0,1,0,1,'T-Shirts','','T-Shirts, ein zeitloses Kleidungsstück, das fast in jedem Kleiderschrank zu finden ist. T-Shirts sind vielseitig, bequem und lassen sich auf verschiedene Weise stylen, was sie zu einem unverzichtbaren Kleidungsstück für jeden Anlass macht. Bei uns haben Sie eine große Auswahl an unterschiedlichen T-Shirts, mit verschiedenen Farben, Mustern und Stilen, sodass für jeden Geschmack etwas dabei ist. ','','','','','','','',0,0,0,1,'T-Shirts','','',0,'','','',0,'','','','t-shirt_damen_4a.png','',NULL,0,1,'2023-03-24 12:16:31'),('8a7ff3dcbc30480b19228b4bf00c8386','07020609d573666017cd883d078e47ac',10,11,'07020609d573666017cd883d078e47ac',0,1,0,1,'Caps','Caps gibt es in vielen verschiedenen Stilen, bei dem für alle was dabei ist','Caps sind eine vielseitige Kopfbedeckung, die in verschiedenen Designs und Stilen erhältlich sind. Sie können aus verschiedenen Materialien wie Baumwolle, Wolle, Leder oder Synthetik hergestellt werden und haben oft einen gebogenen oder flachen Schirm. Caps können zu vielen Anlässen getragen werden, von sportlichen Aktivitäten bis hin zu lässigen oder sogar formellen Anlässen, je nach Stil und Material. Einige Menschen sammeln auch Caps als Erinnerungsstücke oder als Modeaccessoires. Obwohl Caps manchmal mit bestimmten Subkulturen oder Gruppen assoziiert werden, sind sie in der heutigen Mode ein beliebtes und akzeptiertes Accessoire, das von vielen Menschen getragen wird. \r\n\r\nBei uns Finden Sie eine vielseitige Auswahl mit höchster Qualität an Caps und bestelle noch heute! \r\n','','','','','','','',0,0,0,1,'Caps','','',0,'','','',0,'','','','basecap_4.png','',NULL,0,1,'2023-03-23 13:14:40'),('8eacb69eb3e19d0287a0c174ba119bcb','ddf8b64379df19b79b960854f2b9abd2',14,15,'ddf8b64379df19b79b960854f2b9abd2',0,1,0,1,'Zubehör','Praktische Gadgets für den Innen- und Außenraum Ihres Fahrzeugs','Alles für Ihr Auto bei OXID eMotors! Wir bieten Produkte für den Innen- und Außenraum, praktische Gadgets für Reisen und Zubehör für den Transport. Rüsten Sie bequem Ihren PKW auf!','','','','','','','',0,0,0,1,'Accessories','','',0,'','','',0,'','','','kindersitz_3.png','',NULL,0,1,'2023-03-27 14:28:14'),('91c959d1be6af96041072032ead2daf0','ddf8b64379df19b79b960854f2b9abd2',8,9,'ddf8b64379df19b79b960854f2b9abd2',0,1,0,1,'Elektronik','Elektronische Ersatzteile für Ihr Auto','In modernen Autos funktioniert fast alles elektronisch. Die Systeme werden meistens durch Steuergeräte angetrieben, die elektrische Signale von Sensoren auswerten und über Schalter die verschiedenen elektronischen Anwendungen steuern. Zündanlage, Fahrassistenz-System (ABS), Airbag, Scheinwerfer, Rücklichter, Nebelleuchten – das sind nur ein paar Beispiele für elektronische Komponenten im Auto, die bei einer Störung der Sensoren oder Schalter nicht funktionieren würden.\r\n\r\nIm umfangreichen Angebot von OXID eMotors finden Sie elektronische Bauteile, auf die Sie im Falle einer Panne vertrauen können. Vom Tachometer über Park- und Radsensoren bis zum Abstandsradar finden Sie bei uns alles.\r\n','','','','','','','',0,0,0,1,'Electronics','','',0,'','','',0,'','','','steuergert_1.png','',NULL,0,1,'2023-03-27 14:15:30'),('ad70684e0d64f7e62555a26144a1b833','ddf8b64379df19b79b960854f2b9abd2',6,7,'ddf8b64379df19b79b960854f2b9abd2',0,1,0,1,'Technologie','Technologische Komponenten für maximalen Komfort auf kurzen und langen Fahrten','Zu den technologischen Komponenten des Autos zählen wir vor allem das Entertainment im Innenraum Ihres Fahrzeugs. Radios und Lautsprecher, Displays für Smart Car Control und Navigationssysteme tragen erheblich zum Komfort auf kurzen und langen Fahrten bei. Rüsten Sie Ihr Auto auf und stellen Sie fest, wie schnell die Zeit im Auto vergeht!','','','','','','','',0,0,0,1,'Technology','','',0,'','','',0,'','','','autoradio_1a.png','',NULL,0,1,'2023-03-27 14:24:13'),('b368906d4029e7c9ac1acee3e861a04f','ddf8b64379df19b79b960854f2b9abd2',2,3,'ddf8b64379df19b79b960854f2b9abd2',0,1,0,1,'Achsen & Federungen','Komponenten für die Instandhaltung des Fahrwerks','Das Fahrwerk leistet einen wesentlichen Beitrag zu Fahrdynamik und Sicherheit. Es sorgt dafür, dass die durch den Kontakt zwischen Reifen und Fahrbahn freigesetzten Kräfte übertragen werden. Die Anforderungen an das Fahrwerk sind zahlreich: es ist für die Übertragung der Antriebs-, Brems- und Lenkkräfte verantwortlich und soll zudem durch den kontrollierten Einsatz von Untersteuern, ein Übersteuern vermeiden. \r\n\r\nEine optimale Funktion des Fahrwerks, setzt die regelmäßige Instandhaltung einzelner Komponenten desselben voraus. Besonders kommt es hier auf die Federung und die Achsen an. Bei OXID eMotors finden Sie Stoßdämpfer, Antriebswellen und Achskörper.\r\n','','','','','','','',0,0,0,1,'Axles & Suspensions','','',0,'','','',0,'','','','hinterachse_1.png','',NULL,0,1,'2023-03-27 14:10:30'),('c430a8c50b7fe4ef169e8e207a0792b2','07020609d573666017cd883d078e47ac',12,13,'07020609d573666017cd883d078e47ac',0,1,0,1,'Sonnenbrillen','','In den sonnenreichen Monaten des Jahres sind Sonnenbrillen ein unverzichtbares Accessoire. Neben dem Schutz vor UV-Licht sind sie ein modisches Statement. Bei uns finden Sie unterschiedliche Designs, die auf verschiedene Bedürfnisse und Vorlieben zugeschnitten sind. Stöbern Sie sich durch unser Sortiment und finden eine hochwertige Sonnenbrille!','','','','','','','',0,0,0,1,'Sunglasses','','',0,'','','',0,'','','','sonnenbrille_3a.png','',NULL,0,1,'2023-03-23 15:27:53'),('d39fc873b1c92ccf9f9bf2f0a5b938bf','07020609d573666017cd883d078e47ac',14,15,'07020609d573666017cd883d078e47ac',0,1,0,1,'Shorts','Entdecken Sie jetzt unsere Auswahl an Shorts','Genießen Sie den Sommer in vollen Zügen mit unseren hochwertigen Shorts! Unsere Kollektion bietet eine breite Palette an stilvollen und bequemen Shorts für jeden Anlass.\r\n\r\nHergestellt aus hochwertigen Materialien, bieten unsere Shorts ultimativen Komfort und Haltbarkeit. Mit ihrer atmungsaktiven Beschaffenheit und dem leichten Gewicht sind sie die perfekte Wahl für heiße Tage am Strand, Outdoor-Aktivitäten oder einfach nur für den entspannten Tag zu Hause.\r\n\r\nUnsere Shorts gibt es in verschiedenen Farben, Mustern und Designs, um jeden Geschmack und jeden Stil zu bedienen. Egal, ob Sie es klassisch und schlicht oder bunt und auffällig mögen, unsere Shorts haben für jeden etwas zu bieten.\r\n\r\nDie praktischen Taschen unserer Shorts bieten ausreichend Stauraum für Ihre persönlichen Gegenstände wie Schlüssel, Handy und Geldbörse, so dass Sie immer alles Wichtige dabei haben, ohne sich Gedanken über sperrige Taschen machen zu müssen.\r\n\r\nOb am Strand, in der Stadt oder beim Sport - unsere Shorts sind der perfekte Begleiter für einen unbeschwerten und komfortablen Tag. Holen Sie sich jetzt Ihre neuen Lieblings-Shorts und genießen Sie den Sommer in vollen Zügen!','','','','','','','',0,0,0,1,'Shorts','','',0,'','','',0,'','','','shorts_2.png','',NULL,0,1,'2023-03-24 09:24:04'),('d4f56439843be0934dd119a09ee6c022','ddf8b64379df19b79b960854f2b9abd2',4,5,'ddf8b64379df19b79b960854f2b9abd2',0,1,0,1,'Achsteile','Achsersatzteile für Sicherheit und Komfort auf der Fahrt','Die Konstruktion der Achse bestimmt wie sich das Auto beim Beschleunigen und Bremsen sowie bei der Fahrt um eine Kurve verhält. Unebene Strecken können den Geradeauslauf des Wagens beeinflussen – hier kommt die Achse ins Spiel! Sie soll für den Komfort der Passagiere, beim Fahren auf wechselhaften Strecken sorgen.\r\n\r\nBei OXID eMotors finden Sie Querlenker aus Stahl oder Aluminium und Radlager. Mit diesen Ersatzteilen können Sie die Sicherheit und den Komfort Ihres Fahrzeuges langfristig sicherstellen.\r\n','','','','','','','',0,0,0,1,'Axle parts','','',0,'','','',0,'','','','querlenker_1.png','',NULL,0,1,'2023-03-27 14:12:27'),('d78d622962801f00b5dc5149d92b0882','oxrootid',1,2,'d78d622962801f00b5dc5149d92b0882',0,1,1,1,'Downloads','','','','','','','','','',0,0,0,1,'Downloads','','',0,'','','',0,'','','','','',NULL,0,1,'2023-03-29 13:48:16'),('ddf8b64379df19b79b960854f2b9abd2','oxrootid',1,16,'ddf8b64379df19b79b960854f2b9abd2',0,1,0,1,'Ersatzteile','Breites Sortiment an Autoersatzteilen kompatibel mit allen gängigen Automarken','Unser umfangreiches Ersatzteilesortiment umfasst alles, von Achsen und Federungen über Achsteile, Karosserie, Räder, Elektronik und Technologie bis Zubehör. Egal ob für die Instandsetzung des Autos, Reparaturen der äußeren Karosserie, Rad- bzw. Reifenwechsel oder Aufrüstung des Innenraums, in Hinblick auf das Entertainment, die Navigation oder Smart Car Control - wir achten auf das Preis-Leistungsverhältnis und versuchen dabei die Preise so niedrig wie möglich zu halten.\r\n\r\nIhre Autoersatzteile können Sie jeden Tag, 24 Stunden lang bequem bestellen.\r\n','','','','','','','',0,0,0,1,'Spare parts','','',0,'','','',0,'','','','','',NULL,0,1,'2023-03-27 13:55:38');
