pan class=\"usp-text\">Top Quality</span>\r\n                                </li>\r\n                                <li class=\"list-inline-item\">\r\n                                    <svg aria-hidden=\"true\">\r\n                                        <use xlink:href=\"#hand-thumbs-up-fill\"></use>\r\n                                    </svg>\r\n                                    <span class=\"usp-text\">High Customer Satisfaction</span>\r\n                                </li>\r\n                            </ul>',0,'','',0,'','','d78d622962801f00b5dc5149d92b0882','','','2023-04-13 13:00:47'),('0bf2cac712726debc7b2e5c4fed80a72','fashion',1,1,0,1,1,'','Fashion','<div class=\"container-fluid dd-ve-container clearfix\"><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <p>Willkommen in unserem OXID eMotors Online-Shop für Fashion. Hier möchten wir Ihnen unser breites Sortiment an trendiger und hochwertiger Kleidung und modischen Accessoires präsentieren.</p>\r\n\r\n<p>Wir führen eine große Auswahl an verschiedenen Styles, die für jeden Geschmack und jede Gelegenheit geeignet sind. Unser Sortiment umfasst Damen- und Herrenbekleidung sowie eine breite Palette an Accessoires wie Uhren, Taschen, Koffer und Sonnenbrillen. Oxid eMotors legt großen Wert auf Qualität und achtet darauf, dass jeder Artikel sorgfältig ausgewählt und geprüft wird, bevor er ins Sortiment aufgenommen wird. Wir arbeiten eng mit renommierten Herstellern zusammen, um Ihnen stets eine hohe Qualität bieten zu können. </p>\r\n\r\n<p>Unser Fashion Sortiment wird regelmäßig aktualisiert, um sicherzustellen, dass wir immer die neuesten und trendigsten Styles anbieten. Bei uns bekommen Sie eine einfache und benutzerfreundliche Online-Shopping-Erfahrung, bei der Sie Ihre Lieblingsartikel schnell und bequem von zu Hause aus bestellen können.</p>\r\n\r\n<p>Um unsere Fashion Artikel besonders und exklusiv zu halten, sind sie alle mit unserem hochwertigen OXID eMotors Logo versehen. Überzeugen Sie sich selbst und stöbern Sie sich durch unsere verschiedenen Stile und Designs. </p>\r\n\r\n<p>Unser Kundenservice-Team steht Ihnen gerne jederzeit zur Verfügung, um Fragen zu beantworten oder bei der Auswahl von Kleidungsstücken zu helfen. Wir bieten auch schnellen und zuverlässigen Versand, damit Sie Ihre neuen Outfits schnell in den Händen halten können.</p><p><a href=\"/kontakt/\" target=\"_blank\">Jetzt entdecken</a></p>\r\n</div></div></div></div>','Fashion','<div class=\"container-fluid dd-ve-container clearfix\"><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <p>Welcome to our OXID eMotors online store for fashion. Here we would like to present you our wide range of trendy and high quality clothing and fashionable accessories.</p>\r\n\r\n<p>We carry a wide range of different styles suitable for every taste and occasion. Our range includes men\'s and women\'s clothing as well as a wide range of accessories such as watches, bags, suitcases and sunglasses. Oxid eMotors places great emphasis on quality and makes sure that each item is carefully selected and tested before it is included in the assortment. We work closely with reputable manufacturers to always offer you high quality. </p>\r\n\r\n<p>Our fashion range is regularly updated to ensure that we always offer the latest and trendiest styles. With us, you get an easy and user-friendly online shopping experience where you can order your favorite items quickly and from the comfort of your home.</p>\r\n\r\n<p>To keep our fashion items special and exclusive, they all come with our high-quality OXID eMotors logo. See for yourself and browse through our different styles and designs. </p>\r\n\r\n<p>Our customer service team is always available to answer any questions or help you with your clothing selections. We also offer fast and reliable shipping so you can get your hands on your new outfits quickly.</p><p><a href=\"/en/contact/\" target=\"_blank\">Discover Now</a></p>.\r\n</div></div></div></div>',0,'','',0,'','','d78d622962801f00b5dc5149d92b0882','','','2023-04-06 09:19:11'),('0edde8399e69e803a10cd3c293ad56ab','oxstartusps',1,1,0,1,1,'','USPs für Startseite','<div class=\"usp-list usp-list-content\">\r\n	<div class=\"slider-container\">\r\n		<div class=\"list-inline-item\">\r\n			<svg aria-hidden=\"true\">\r\n				<use xlink:href=\"#box2-fill\"/>\r\n			</svg>\r\n			<span class=\"usp-text\">Schnelle Lieferung</span>\r\n		</div>\r\n		<div class=\"list-inline-item\">\r\n			<svg aria-hidden=\"true\">\r\n				<use xlink:href=\"#headset\"/>\r\n			</svg>\r\n			<span class=\"usp-text\">Individuelle Beratung</span>\r\n		</div>\r\n		<div class=\"list-inline-item\">\r\n			<svg aria-hidden=\"true\">\r\n				<use xlink:href=\"#truck\"/>\r\n			</svg>\r\n			<span class=\"usp-text\">Express Lieferung</span>\r\n		</div>\r\n		<div class=\"list-inline-item\">\r\n			<svg aria-hidden=\"true\">\r\n				<use xlink:href=\"#shield-fill-check\"/>\r\n			</svg>\r\n			<span class=\"usp-text\">Top Qualität</span>\r\n		</div>\r\n		<div class=\"list-inline-item\">\r\n			<div class=\"list-inline-item\">\r\n				<svg aria-hidden=\"true\">\r\n					<use xlink:href=\"#hand-thumbs-up-fill\"/>\r\n				</svg>\r\n				<span class=\"usp-text\">Hohe Kundenzufriedenheit</span>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>','Startpage USPs','<div class=\"usp-list usp-list-content\">\r\n	<div class=\"slider-container\">\r\n		<div class=\"list-inline-item\">\r\n			<svg aria-hidden=\"true\">\r\n				<use xlink:href=\"#box2-fill\"/>\r\n			</svg>\r\n			<span class=\"usp-text\">Fast Delivery</span>\r\n		</div>\r\n		<div class=\"list-inline-item\">\r\n			<svg aria-hidden=\"true\">\r\n				<use xlink:href=\"#headset\"/>\r\n			</svg>\r\n			<span class=\"usp-text\">Individual Advice</span>\r\n		</div>\r\n		<div class=\"list-inline-item\">\r\n			<svg aria-hidden=\"true\">\r\n				<use xlink:href=\"#truck\"/>\r\n			</svg>\r\n			<span class=\"usp-text\