o:{{  oxcmp_shop.oxshops__oxowneremail.value  }}?subject=Produktidee\"><strong>{{  oxcmp_shop.oxshops__oxowneremail.value  }}</strong></a>.</div>','How to order?','<h2>{{  oxcmp_shop.oxshops__oxname.value  }}, your online store for ...</h2>\r\n<p>With us, you can choose from more than ... products of high quality and reputable manufacturers. Take a look around and browse through our offers!<br />\r\nOn the internet {{  oxcmp_shop.oxshops__oxname.value  }} is open 24/7.</p>\r\n<p>If you want to place an order you can purchase</p>\r\n<ul>\r\n<li class=\"font11\">via our online store</li>\r\n<li class=\"font11\">via fax {{  oxcmp_shop.oxshops__oxtelefax.value  }} </li>\r\n<li class=\"font11\">via telephone {{  oxcmp_shop.oxshops__oxtelefon.value  }} </li>\r\n<li class=\"font11\">or via e-mail <a href=\"mailto:{{  oxcmp_shop.oxshops__oxowneremail.value  }}?subject=Order\"><strong>{{  oxcmp_shop.oxshops__oxowneremail.value  }}</strong></a></li></ul>\r\n<p>By telephone, we are available<br />\r\nMonday to Friday 10 AM thru 6 PM. </p>\r\n<p>If you are looking for an item that did not match the range of {{  oxcmp_shop.oxshops__oxname.value  }}, let\'s us know. We are happy to find a solution for you.</p>\r\n<p>Write to <a href=\"mailto:{{  oxcmp_shop.oxshops__oxowneremail.value  }}?subject=Product idea\"><strong>{{  oxcmp_shop.oxshops__oxowneremail.value  }}</strong></a></p>',1,'','',1,'','','30e44ab83fdee7564.23264141','CMSFOLDER_USERINFO','','2023-04-25 10:17:00'),('12c17f85fedc133532ed3ff0caec3273','kundenservice',1,1,0,1,1,'','Kundenservice','<div class=\"container-fluid dd-ve-container clearfix\"><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <h2>Versand</h2><p>Nachdem Sie Ihre Bestellung getätigt haben, arbeiten wir mit Hochdruck daran, um Sie schnellstmöglich zu bearbeiten und zu Ihnen zu versenden. Daher arbeiten wir mit zuverlässigen, kompetenten Partnern zusammen.</p><h2>Gütesiegel</h2><p>Ihre Zufriedenheit steht an erster Stelle! Top Kundenservice, gute Preise und beste Qualität! Wir sind zertifiziert und garantieren Ihnen ein rundumsorglos Shoppingerlebnis.</p><h2>Beratung &amp; Kundenservice</h2><p>Sie brauchen Unterstützung beim Kauf in unserem Onlineshop? Unser Kundenservice hilft Ihnen gerne weiter! Schnelle Antwortzeiten sorgen für zuverlässige Hilfe.</p><h2>Wir über uns</h2><p>Sie wollen mehr zu uns erfahren? Dann finden Sie hier weitere Informationen zum Apex Shop!</p><h2>FAQ</h2><p>Wir helfen Ihnen gerne so schnell wie möglich weiter. Hier finden Sie unseren Hilfebereich mit den am häufigsten gestellten Fragen.</p>\r\n</div></div></div></div>','Customer service','<div class=\"container-fluid dd-ve-container clearfix\"><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <h2>Shipping</h2><p>After you have placed your order, we work hard to process and ship it to you as quickly as possible. Therefore, we work with reliable, competent partners.</p><h2>Quality Seal</h2><p>Your satisfaction is our top priority! Top customer service, good prices, and the best quality! We are certified and guarantee you an all-round worry-free shopping experience.</p><h2>Advice &amp; Customer Service</h2><p>Do you need assistance with your purchase on our online shop? Our customer service team is here to help you! Fast response times ensure reliable assistance.</p><h2>About Us</h2><p>Do you want to learn more about us? Then you can find more information about the Apex Shop here!</p><h2>FAQ</h2><p>We are happy to assist you as quickly as possible. You can find our help section with the most frequently asked questions <a href=\"/en/help\">here!</a></p>\r\n</div></div></div></div>',0,'','',0,'','','d78d622962801f00b5dc5149d92b0882','','','2023-04-06 09:29:49'),('1544167b4666ccdc1.28484600','oxblocked',1,1,0,1,1,'','Benutzer geblockt','<div><span style=\"color: #ff0000\"><strong>Der Zugang wurde Ihnen verweigert!</strong></span></div>\r\n<div>&nbsp;</d