d text-white bg-transparent dd-image-box\">\r\n                    <img loading=\"lazy\" src=\"/out/pictures/ddmedia/_3.jpg\" width=\"1500\" height=\"700\" alt=\"_3.jpg\" style=\"display: block; max-width: 100%; height: auto; margin: 0 auto;\">\r\n                                        <a href=\"/out/pictures/ddmedia/_3.jpg\" class=\"stretched-link\" target=\"_blank\" data-toggle=\"lightbox\" data-gallery=\"gallery_643fccbd96d49\" aria-label=\"Bild 3 vergrößert darstellen\"></a>\r\n                </div>\r\n            </div>\r\n        \r\n    </div>\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <div>Einen <abbr>SUV</abbr> kennt jeder, sieht jeder, jeden Tag. Das liegt an den Wünschen der Gesellschaft, wenn es um eines der wichtigsten Dinge für viele geht. Ein Fahrzeug, in welchem man hoch sitzt, genug Platz für jedermann vorhanden ist und vor allem ein ausgezeichneter Überblick über den Verkehr gewährt ist. Sport Utility Vehicles sind Fahrzeuge, welche an einen Geländewagen erinnern, durch den optisch höheren Einstieg aber auch an eine Kombilimousine erinnern. Einer der wichtigsten Aspekte, welchen ein <abbr>SUV</abbr> vorweisen kann, ist dass sie durch die größere Bodenfreiheit sicherer sind, einen besseren Überblick bieten und das Aus- und Einsteigen einfacher gestalten. Gerade für Familien spielen diese Details eine große Rolle, ebenso wie die Geräumigkeit der Autos. Vergleichsweise steigert ein <abbr>SUV</abbr> das Sicherheitsempfinden der Fahrer sowie Mitfahrer um einiges. Durch die Individuelle Ausstattung der Fahrzeuge, welche je nach Wunsch konfiguriert werden kann, überzeugt ein <abbr>SUV</abbr> schon von Grund auf mit den Basics. Durch neue Technologien im Bereich der Airbags und Gurte ist die Verletzungsgefahr bei einem Unfall minimiert worden und die Sicherheit durch Spurhaltesystem und Notbremsassistent maximiert. Da nicht nur die Ausstattung und die Nützlichkeit eines Autos im Vordergrund steht, sondern auch das Erscheinungsbild, überzeugt ein <abbr>SUV</abbr> auch hier auf ganzer Strecke. Durch ein sportliches und kraftvolles Aussehen zieht das Fahrzeug immer mehr Aufsehen und Anerkennung auf sich.</div><h2><span style=\"font-size: 24px;\">Welche Größe darf es für Sie sein?</span></h2><div>Da umso größer das Auto umso besser nicht für jeden Fahrzeughalter gilt, kann bei den <abbr>SUV</abbr>s zwischen verschiedenen Modellen gewählt werden. Soll es eher für einen Großstadtdschungel oder für das Familienleben auf dem Land passend sein? Ganz egal, von Mini über Kompakt bis zu groß ist alles bei dem modernen Lifestyle- Fahrzeug mit dabei. Hier gibt es eine Vielzahl an varianten, welche es zu vergleichen gibt. Angefangen bei der Ausstattung, dem Antrieb oder dem Aufbau. Ist ein Allrad notwendig oder reicht ein Frontantrieb? Wie fahre ich möglichst sparsam ohne einen hohen Kraftstoffverbrauch? Diese und viele weitere Fragen gilt es sich zu stellen, bei dem Auswählen des passenden <abbr>SUV</abbr>s.</div><div><br></div><div><span style=\"color: inherit; font-family: inherit; font-size: 18px;\">Wir machen Träume wahr!</span></div><div><br></div><div>Trotz dem gleichen Grundgedanken und der vielen Gemeinsamkeiten gibt es große Unterschiede bei der Preisgestaltung sowie der generellen Größe der Fahrzeuge. Um das individuell gestaltete Auto zu finanzieren, macht es einen großen Vorteil aus, einen Jahreswagen zu leasen, um somit sorgenfrei den Fahrspaß genießen zu können.&nbsp;&nbsp;<br></div><div><br></div><div>Welche Vorteile, Konditionen und Rahmenbedingungen hierbei eine Rolle spielen werden anschließend nochmals individuell erläutert.&nbsp;&nbsp;</div><div><br></div><div>Hier können Sie sich Informieren und direkt einen Beratungstermin vereinbaren!</div><div><br></div><div><a href=\"/kontakt/\" target=\"_blank\"><u>Termin vereinbaren</u></a></div>\r\n</div></div></div></div>','OX5 Family SUV - The family-friendly choice','<div class=\"container-fluid dd-ve-container clearfix\"><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    Sporty, dynamic and agile. All to be found in one vehicle.&nbsp;\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\">    \r\n\r\n<div class=\"dd-shortcode-gallery dd-image-gallery\">\r\n    <div class=\"row\">\r\n                    <div class=\"col-12 col-sm-4\">\r\n                <div class=\"card text-white bg-transparent dd-image-box\">\r\n                    <img loading=\"lazy\" src=\"/out/pictures/ddmedia/1.jpg\" width=\"1500\" height=\"700\" alt=\"1.jpg\" style=\"display: block; max-width: 100%; height: auto; margin: 0 auto;\">\r\n                                        <a href=\"/out/pictures/ddmedia/1.jpg\" class=\"stretched-link\" target=\"_blank\" data-toggle=\"lightbox\" data-gallery=\"gallery_643fe8a6289ff\" aria-label=\"Enlarge image 1\"></a>\r\n                </div>\r\n            </div>\r\n                    <div class=\"col-12 col-sm-4\">\r\n                <div class=\"card text-white bg-transparent dd-image-box\">\r\n                    <img loading=\"lazy\" src=\"/out/pictures/ddmedia/_4.jpg\" width=\"1500\" height=\"700\" alt=\"_4.jpg\" style=\"display: block; max-width: 100%; height: auto; margin: 0 auto;\">\r\n                                        <a href=\"/out/pictures/ddmedia/_4.jpg\" class=\"stretched-link\" target=\"_blank\" data-toggle=\"lightbox\" data-gallery=\"gallery_643fe8a6289ff\" aria-label=\"Enlarge image 2\"></a>\r\n                </div>\r\n            </div>\r\n                    <div class=\"col-12 col-sm-4\">\r\n                <div class=\"card text-white bg-transparent dd-image-box\">\r\n                    <img loading=\"lazy\" src=\"/out/pictures/ddmedia/_3.jpg\" width=\"1500\" height=\"700\" alt=\"_3.jpg\" style=\"display: block; max-width: 100%; height: auto; margin: 0 auto;\">\r\n                                        <a href=\"/out/pictures/ddmedia/_3.jpg\" class=\"stretched-link\" target=\"_blank\" data-toggle=\"lightbox\" data-gallery=\"gallery_643fe8a6289ff\" aria-label=\"Enlarge image 3\"></a>\r\n                </div>\r\n            </div>\r\n        \r\n    </div>\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <div>Everyone knows and sees an <abbr>SUV</abbr> every day. This is due to society\'s desires when it comes to one of the most important things for many people: a vehicle in which you sit high, has enough space for everyone, and provides an excellent view of the road. Sport Utility Vehicles (<abbr>SUV</abbr>s) are vehicles that resemble off-road vehicles, but with the visually higher entry of a station wagon. One of the most important aspects of an <abbr>SUV</abbr> is that they are safer due to the increased ground clearance, provide a better view of the road, and make getting in and out easier. These details are especially important for families, as is the spaciousness of the vehicles. An <abbr>SUV</abbr> comparatively increases the sense of safety for both drivers and passengers. With the individual customization of the vehicles, which can be configured according to the customer\'s wishes, an <abbr>SUV</abbr> already convinces with the basics. New technologies in the area of airbags and seat belts have minimized the risk of injury in the event of an accident, and safety is maximized through lane departure warning systems and emergency braking assistance. Since not only the equipment and usefulness of a car are important, but also its appearance, an <abbr>SUV</abbr> also impresses in this regard. With a sporty and powerful appearance, the vehicle attracts more attention and recognition.</div><h2>What size is right for you?</h2><div>Since bigger is not always better for every car owner, different models of <abbr>SUV</abbr>s can be chosen. Should it be more suitable for a big city jungle or for family life in the countryside? No matter what, from mini to compact to large, everything is available with the modern lifestyle vehicle. There are a variety of options to compare, starting with the equipment, the drive or the structure. Is all-wheel drive necessary, or is front-wheel drive sufficient? How can I drive as economically as possible without high fuel consumption? These and many other questions need to be asked when selecting the right <abbr>SUV</abbr>.<br></div><h2>We make dreams come true</h2><div>Despite the same basic idea and many similarities, there are significant differences in price and overall size of the vehicles. To finance the individually designed car, it is a great advantage to lease a used car, allowing you to enjoy driving without any worries.&nbsp;&nbsp;<br></div><div><br></div><div>The advantages, conditions and framework conditions that play a role here are then explained again individually. <br><a href=\"/Service/Beratungstermin\" target=\"_blank\">Click here</a> to learn more and schedule a consultation appointment.<br><button type=\"button\" class=\"btn btn-primary\">Schedule appointment</button></div>\r\n</div></div></div></div>',0,'','',0,'','','d78d622962801f00b5dc5149d92b0882','','','2023-04-19 13:48:13'),('608da57fba8b5f2c4418e73144866e34','ersatzteile',1,1,0,1,1,'','OXID eMotors – Autoersatzteile','<div class=\"container-fluid dd-ve-container clearfix\"><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <p>Auto-Ersatzteile sind ein wichtiger Bestandteil des Auto-Service- und Reparaturprozesses. Egal, ob es sich um Verschleißteile wie Bremsbeläge und Ölfilter oder um schwerwiegende Teile wie Motoren und Getriebe handelt, Ersatzteile sind unerlässlich, um sicherzustellen, dass Ihr Auto reibungslos und sicher läuft.</p><p>Beim Kauf von Ersatzteilen ist es wichtig, darauf zu achten, dass die Teile von hoher Qualität sind und den gleichen Spezifikationen wie die Originalteile entsprechen. Das bedeutet, dass sie sicher, langlebig und zuverlässig sind und Ihrem Auto die bestmögliche Leistung bieten. </p><p>Letztendlich sind sie ein wichtiger Aspekt der Autoinstandhaltung und sollten immer von hoher Qualität sein. </p><p>Mit der richtigen Pflege und Wartung Ihres Autos und dem Einsatz von hochwertigen Ersatzteilen kann Ihr Auto viele Jahre zuverlässig und sicher fahren. </p><p>Oxid eMotors möchte seinen Kunden hochwertige und qualitative Ersatzteile bieten und garantieren so sichere, zuverlässige und langlebige Auto-Ersatzteile.  </p><p>Unsere Experten stehen Ihnen zur Verfügung, um Sie bei der Auswahl der richtigen Ersatzteile für Ihr Fahrzeug zu unterstützen. Außerdem helfen wir Ihnen auch bei der Installation der Teile oder können Sie bei Bedarf an eine qualifizierte Werkstatt in Ihrer Nähe verweisen. </p><p>Wenn Sie Fragen haben oder weitere Informationen benötigen, zögern Sie bitte nicht, uns zu kontaktieren. Wir sind immer bereit, Ihnen zu helfen und Ihnen den bestmöglichen Service zu bieten. </p><p>Wir hoffen, dass wir Ihnen helfen können, Ihr Fahrzeug in bestem Zustand zu halten und lange Freude daran zu haben!</p><p><a href=\"/Ersatzteile/\" target=\"_blank\">Hier zu unseren Ersatzteilen</a></p>\r\n</div></div></div></div>','OXID eMotors - Car spare parts','<div class=\"container-fluid dd-ve-container clearfix\"><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <p>Auto parts are an important part of the car service and repair process. Whether it\'s wear parts like brake pads and oil filters or serious parts like engines and transmissions, spare parts are essential to ensure that your car runs smoothly and safely.</p>\r\n<p>When buying spare parts, it is important to ensure that the parts are of high quality and meet the same specifications as the original parts. That means they are safe, durable, reliable, and provide your car with the best possible performance.</p>\r\n<p>Ultimately, they are an important aspect of car maintenance and should always be of high quality.</p>\r\n<p>With the proper care and maintenance of your car, and the use of high-quality spare parts, your car can drive reliably and safely for many years.</p>\r\n<p>Oxid eMotors wants to provide its customers with high-quality and reliable spare parts, guaranteeing safe, reliable, and durable auto parts.</p>\r\n<p>Our experts are available to assist you in selecting the right replacement parts for your vehicle. We can also help you with the installation of the parts or refer you to a qualified workshop in your area if needed.</p>\r\n<p>If you have any questions or need further information, please do not hesitate to contact us. We are always ready to help and provide you with the best possible service.</p>\r\n<p>We hope we can help you keep your vehicle in the best possible condition and enjoy it for a long time!</p>\r\n<p><a href=\"/en/Spare-parts/\" target=\"_blank\">Click here for our spare parts</a></p>\r\n</div></div></div></div>',0,'','',0,'','','d78d622962801f00b5dc5149d92b0882','','','2023-04-06 09:56:37'),('67c5bcf75ee346bd9566bce6c8','oxcredits',1,0,3,0,1,'','Credits','','Credits','Please add your text here.',1,'','',0,'','','30e44ab83fdee7564.23264141','CMSFOLDER_USERINFO','','2020-07-16 14:22:04'),('6c591f73eba66583b540c2b45d84f04c','oxstartslot3',1,1,0,1,1,'','Startpage Intro-Teaser 3','<div class=\"container-fluid dd-ve-container clearfix\"><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text-image-row style-1 space-0\">\r\n            \r\n    <div class=\"container-xxl\">\r\n                                <div class=\"row\">\r\n                                    <div class=\"col\">\r\n                        <div class=\"card text-white zoom-in\">\r\n                            <img src=\"/out/pictures/ddmedia/Auto_02_Mood_2_silber.jpg\" class=\"card-img card-img-full\" alt=\"Der Sportliche (Sportwagen)\" width=\"1600\" height=\"550\">\r\n                            <div class=\"card-img-overlay\">\r\n                                <div class=\"card-img-overlay-content\">\r\n                                                                        <div class=\"card-title h2 mb-3\">\r\n                                        Der Sportliche (Sportwagen)\r\n                                    </div>\r\n                                                                                                            <p class=\"d-none d-md-block card-text\">Für Reisende oder Ihr Business. Mit seinem atemberaubenden Design und der kraftvollen Motorleistung ist dieser Sportwagen ein wahrer Hingucker auf der Straße. Egal, ob Sie auf der Suche nach einem Adrenalinkick oder einem zuverlässigen Begleiter für Ihre täglichen Fahrten sind, dieser Wagen bietet Ihnen alles, was Sie sich wünschen.</p>\r\n                                                                                                            <span class=\"btn btn-secondary me-auto\">Jetzt anschauen</span>\r\n                                                                    </div>\r\n                            </div>\r\n                                                        <a href=\"/Sportwagen/\" class=\"stretched-link\" aria-label=\"Jetzt anschauen\"></a>\r\n                                                    </div>\r\n                    </div>\r\n                            </div>\r\n            </div>\r\n</div>\r\n</div></div></div>','Startpage Intro-Teaser 3','<div class=\"container-fluid dd-ve-container clearfix\"><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text-image-row style-1 space-0\">\r\n    <div class=\"container-xxl\">\r\n        <div class=\"row\">\r\n            <div class=\"col\">\r\n                        <div class=\"card text-white zoom-in\">\r\n                            <img src=\"/out/pictures/ddmedia/SportsCar_Sc1.jpg\" class=\"card-img card-img-full\" alt=\"The sporty (sports car)\" width=\"1600\" height=\"550\">\r\n                            <div class=\"card-img-overlay\">\r\n                                <div class=\"card-img-overlay-content\">\r\n                                                                        <div class=\"card-title h2 mb-3\">\r\n                                        The sporty (sports car)\r\n                                    </div>\r\n                                                                                                            <p class=\"d-none d-md-block card-text\">For travelers or their business. With its stunning design and powerful engine performance, this sports car is a real eye-catcher on the road. Whether you\'re looking for an adrenaline rush or a reliable companion for your daily drives, this car has everything you want.</p>\r\n                                                                                                            <span class=\"btn btn-secondary me-auto\">View now</span>\r\n                                                                    </div>\r\n                            </div>\r\n                                                        <a href=\"/en/Sports-car-the-fast-powerful-and-stylish-car/\" class=\"stretched-link\" aria-label=\"View now\"></a>\r\n                                                    </div>\r\n                    </div>\r\n                            </div>\r\n            </div>\r\n</div>\r\n</div></div></div>',0,'','',0,'','','d78d622962801f00b5dc5149d92b0882','','','2023-04-06 06:41:14'),('7d3ceca4ec7869ede0611fc0ae6724b6','unserkastenwagen',1,1,0,1,1,'','Unser Kastenwagen – Praktisch, Flexibel und Sparsam','<div class=\"container-fluid dd-ve-container clearfix\"><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <p>Ob Kleinunternehmer, Kurierfahrer oder Handwerker, die Anschaffung eines Kastenwagens ist immer eine gute Investition. Mit seiner enorm großen Ladefläche ist er perfekt für den Transport von Waren und Gütern ausgelegt. Doch nicht nur als Unternehmer lohnt sich eine Investition, denn ein Kastenwagen kann auch schnell in ein Wohnmobil umgebaut werden und ist so eine beliebte Wahl für Reisende, die ein mobiles Zuhause benötigen.</p><p>Mit unseren drei verschiedenen Fahrzeug Modellen helfen wir Ihnen, den perfekten Kastenwagen für Sie zu finden!</p><h2>Mein Kastenwagen – was muss er im Alltag können?</h2><p>Ein Kastenwagen sollte in der Lage sein, verschiedene Anforderungen zu erfüllen. So ist eine ausreichende Nutzlast für den sicheren und effizienten Transport einer Ladung sehr wichtig. Zudem sollte bei der Wahl des Kastenwagens auf das Laderaumvolumen geachtet werden, da dieser groß genug sein sollte, um die benötigte Menge an Gütern zu transportieren.</p><p>Ein Kastenwagen ist oft großen Lasten und weiten Strecken ausgesetzt, so dass von Anfang an mit Folgekosten für Reparaturen und Wartungen gerechnet werden muss.</p><h2>Unser CargoMaster</h2><p>Wir stellen unseren CargoMaster vor. Ein geräumiger Kastenwagen mit einem modernen Design und fortschrittlicher Technologie. Wir bieten Ihnen mit unserem CargoMaster eine beeindruckende Ladekapazität von 18,4 m³ und eine maximale Nutzlast von 5,5 Tonnen. Die Ladefläche ist vielseitig gestaltbar und kann durch zusätzliche Regalsysteme und Zubehörteile an Ihre Bedürfnisse angepasst werden.</p><p>Wir versprechen Ihnen mit unserem CargoMaster einen robusten und vielseitigen Kastenwagen, der für Sie eine ideale Transportlösung bietet. Überzeugen Sie sich selbst und erleben eine angenehme und sichere Fahrt.</p>\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\">\r\n\r\n\r\n    \r\n\r\n<div class=\"dd-shortcode-image dd-image-box my-4\">\r\n    <div class=\"card text-white bg-transparent\">\r\n        <img loading=\"lazy\" src=\"/out/pictures/ddmedia/Design ohne Titel (64)_1.jpg\" width=\"1500\" height=\"800\" alt=\"\">\r\n                            <a href=\"/out/pictures/ddmedia/Design ohne Titel (64)_1.jpg\" class=\"stretched-link\" data-toggle=\"lightbox\" aria-label=\"Bild allein anzeigen\"></a>\r\n            </div>\r\n</div>\r\n\r\n</div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <p>OXID eMotors hat es sich zur Aufgabe gemacht, Ihnen bei der Entscheidung zu helfen, den perfekten Kastenwagen zu finden. So gibt es unseren Kastenwagen CargoMaster in drei verschiedenen Karosserielängen. Mit ihm finden Sie einen Alltagsbegleiter, ideal für den Stadtverkehr, ohne dabei auf Ladevolumen verzichten zu müssen. Brauchen Sie es aber doch noch etwas größer, haben wir für Sie den CargoMaster&nbsp;X1 und CargoMaster&nbsp;X2 mit einer maximalen Ladelänge von 3.5 und 4 Metern.</p>\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-6 col-xs-12\"><div class=\"dd-shortcode-text-image-row style-1 space-0\">\r\n            \r\n    <div class=\"container-xxl\">\r\n                                <div class=\"row\">\r\n                                    <div class=\"col\">\r\n                        <div class=\"card text-white zoom-in\">\r\n                            <img src=\"/out/pictures/ddmedia/CargoMaster X1_scribble.jpg\" class=\"card-img card-img-full\" alt=\"\" width=\"1600\" height=\"550\">\r\n                            <div class=\"card-img-overlay\">\r\n                                <div class=\"card-img-overlay-content\">\r\n                                                                                                            <p class=\"d-none d-md-block card-text\"></p><p>Laderaumlänge: 2.512 mm</p>\r\n<p>Maximale Länge der Ladung: 4.026 mm</p>\r\n<p>Laderaumhöhe: 1.397 mm</p>\r\n<p>Laderaumbreite: 1.628 mm</p>\r\n<p>Maximale Nutzlast: 1.000 kg</p>\r\n                                                                                                        </div>\r\n                            </div>\r\n                                                    </div>\r\n                    </div>\r\n                            </div>\r\n            </div>\r\n</div>\r\n</div><div class=\"col-sm-6 col-xs-12\"><div class=\"dd-shortcode-text-image-row style-1 space-0\">\r\n            \r\n    <div class=\"container-xxl\">\r\n                                <div class=\"row\">\r\n                                    <div class=\"col\">\r\n                        <div class=\"card text-white zoom-in\">\r\n                            <img src=\"/out/pictures/ddmedia/CargoMaster X2_scribble.jpg\" class=\"card-img card-img-full\" alt=\"\" width=\"1600\" height=\"550\">\r\n                            <div class=\"card-img-overlay\">\r\n                                <div class=\"card-img-overlay-content\">\r\n                                                                                                            <p class=\"d-none d-md-block card-text\"></p><p>Laderaumlänge: 2.862 mm</p>\r\n<p>Maximale Länge der Ladung: 4.525 mm</p>\r\n<p>Laderaumhöhe: 1.397 mm</p>\r\n<p>Laderaumbreite: 1.628 mm</p>\r\n<p>Maximale Nutzlast: 1.360 kg</p>\r\n                                                                                                        </div>\r\n                            </div>\r\n                                                    </div>\r\n                    </div>\r\n                            </div>\r\n            </div>\r\n</div>\r\n</div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <p>Als Unternehmer ist für Sie ein Kastenwagen unverzichtbar und unser CargoMaster steht Ihnen mit fünf verschiedenen Dieselmotoren zur Verfügung, mit denen Sie Betriebskosten senken und die Belastung der Umwelt reduzieren können.&nbsp;<br>Vereinbaren Sie jetzt einen kostenlosen Beratungstermin!</p><div><button type=\"button\" class=\"btn btn-primary\">Termin vereinbaren</button></div>\r\n</div></div></div></div>','Our van - Practical, Flexible and Economical','<div class=\"container-fluid dd-ve-container clearfix\"><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <p>Whether you are a small business owner, courier driver or tradesman, purchasing a panel van is always a good investment. With its enormously large loading area, it is perfectly designed for transporting goods and merchandise. But it\'s not only worth investing in as an entrepreneur, because a panel van can also be quickly converted into a camper van, making it a popular choice for travelers who need a mobile home.</p><p>With our three different vehicle models, we\'ll help you find the perfect panel van for you!</p><h2>My panel van - what does it need to be able to do in everyday life?</h2><p>A panel van should be able to meet various requirements. For example, a sufficient payload is very important for the safe and efficient transport of a load. In addition, when choosing a panel van, attention should be paid to the cargo volume, as it should be large enough to transport the required amount of goods.</p><p>A panel van is often exposed to large loads and long distances, so follow-up costs for repairs and maintenance should be expected from the very beginning.</p><h2>Our CargoMaster</h2><p>We introduce our CargoMaster. A spacious box van with a modern design and advanced technology. With our CargoMaster, we offer you an impressive load capacity of 18.4 m³ and a maximum payload of 5.5 tons. The loading area is versatile and can be adapted to your needs with additional racking systems and accessories.</p><p>With our CargoMaster, we promise you a robust and versatile box van that offers an ideal transport solution for you. Convince yourself and experience a pleasant and safe journey.</p>\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\">\r\n\r\n\r\n    \r\n\r\n<div class=\"dd-shortcode-image dd-image-box my-4\">\r\n    <div class=\"card text-white bg-transparent\">\r\n        <img loading=\"lazy\" src=\"/out/pictures/ddmedia/Auto_03b_Seite.jpg\" width=\"1500\" height=\"1500\" alt=\"\">\r\n                            <a href=\"/out/pictures/ddmedia/Auto_03b_Seite.jpg\" class=\"stretched-link\" data-toggle=\"lightbox\" aria-label=\"Show Picture separately\"></a>\r\n            </div>\r\n</div>\r\n\r\n</div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <p>OXID eMotors has made it its business to help you decide which box van is perfect for you. Thus, our CargoMaster panel van is available in three different body lengths. With it, you will find an everyday companion, ideal for city traffic, without having to sacrifice cargo volume. But if you need it a little bigger, we have the CargoMaster&nbsp;X1 and CargoMaster&nbsp;X2 with a maximum load length of 3.5 and 4 meters.</p>\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-6 col-xs-12\"><div class=\"dd-shortcode-text-image-row style-1 space-t\">\r\n                                <div class=\"container-xxl\">\r\n                                        <br>\r\n                    </div>\r\n    \r\n    <div class=\"container-xxl\">\r\n                                <div class=\"row\">\r\n                                    <div class=\"col\">\r\n                        <div class=\"card text-white zoom-in\">\r\n                            <img src=\"/out/pictures/ddmedia/CargoMaster X1_scribble.jpg\" class=\"card-img card-img-full\" alt=\"CargoMaster X1\" width=\"1600\" height=\"550\">\r\n                            <div class=\"card-img-overlay\">\r\n                                <div class=\"card-img-overlay-content\">\r\n                                                                        <div class=\"card-title h2 mb-3\">\r\n                                        CargoMaster X1\r\n                                    </div>\r\n                                                                                                            <p class=\"d-none d-md-block card-text\"></p><p>Load compartment length: 2,512 mm</p><p>Maximum load length: 4,026 mm</p><p>Load compartment height: 1,397 mm</p><p>Load compartment width: 1,628 mm</p><p>Maximum payload: 1,000 kg</p>\r\n                                                                                                        </div>\r\n                            </div>\r\n                                                    </div>\r\n                    </div>\r\n                            </div>\r\n            </div>\r\n</div>\r\n</div><div class=\"col-sm-6 col-xs-12\"><div class=\"dd-shortcode-text-image-row style-1 space-t\">\r\n                                <div class=\"container-xxl\">\r\n                                        <br>\r\n                    </div>\r\n    \r\n    <div class=\"container-xxl\">\r\n                                <div class=\"row\">\r\n                                    <div class=\"col\">\r\n                        <div class=\"card text-white zoom-in\">\r\n                            <img src=\"/out/pictures/ddmedia/CargoMaster X2_scribble.jpg\" class=\"card-img card-img-full\" alt=\"CargoMaster X2\" width=\"1600\" height=\"550\">\r\n                            <div class=\"card-img-overlay\">\r\n                                <div class=\"card-img-overlay-content\">\r\n                                                                        <div class=\"card-title h2 mb-3\">\r\n                                        CargoMaster X2\r\n                                    </div>\r\n                                                                                                            <p class=\"d-none d-md-block card-text\"></p><p>Load compartment length: 2,862 mm</p><p>Maximum load length: 4,525 mm</p><p>Load compartment height: 1,397 mm</p><p>Load compartment width: 1,628 mm</p><p>Maximum payload: 1,360 kg</p>\r\n                                                                                                        </div>\r\n                            </div>\r\n                                                    </div>\r\n                    </div>\r\n                            </div>\r\n            </div>\r\n</div>\r\n</div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <p>As a business owner, a panel van is essential for you and our CargoMaster is available with five different diesel engines to help you cut operating costs and reduce your impact on the environment.&nbsp;<br>Make a free consultation appointment now!</p><div><button type=\"button\" class=\"btn btn-primary\">Make an appointment</button></div>\r\n</div></div></div></div>',0,'','',0,'','','d78d622962801f00b5dc5149d92b0882','','','2023-04-19 13:59:54'),('84a42e66105998a86.14045828','oxuserorderemailend',1,1,0,1,1,'','Ihre Bestellung Abschluss','<div align=\"left\">Fügen Sie hier Ihre Widerrufsbelehrung ein.</div>','your order terms','<p>Right to Withdrawal can be inserted here.</p>',1,'','',1,'','','30e44ab83fdee7564.23264141','CMSFOLDER_EMAILS','','2020-07-16 14:22:04'),('84a42e66123887821.29772527','oxuserorderemailendplain',1,1,0,1,1,'','Ihre Bestellung Abschluss Plain','Fügen Sie hier Ihre Widerrufsbelehrung ein.','your order terms plain','<p>Right to Withdrawal can be inserted here.</p>',1,'','',1,'','','30e44ab83fdee7564.23264141','CMSFOLDER_EMAILS','','2020-07-16 14:22:04'),('8709e45f31a86909e9f999222e80b1d0','oxstdfooter',1,1,0,1,1,'','Standard Footer','<div>OXID Online Demoshop - Ihr zuverlässiger Partner für Fahrzeuge, Ersatzteile und Merchandise</div>','standard footer','<div>OXID Online Demoshop - your reliable partner for vehicles, spare parts and merchandise</div>',1,'','',1,'','','30e44ab83fdee7564.23264141','','','2020-07-16 14:22:04'),('90606fd91cc9d5dbcd24caa7f9a77a1b','sparen',1,1,0,1,1,'','Attraktives Sparen','<div class=\"container-fluid dd-ve-container clearfix\"><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <h2>Wir lieben es zu sparen - Sie auch?</h2><p>Ihr Traum von einem eigenen Fahrzeug mit uns zusammen erfüllen. Konfigurieren Sie Ihr Wunschmodell ganz nach Ihren Vorstellungen und aktivieren Sie Ihre ganz persönlichen Rabatte. Wir freuen uns Ihnen immer die aktuellen Neuwagen zu einem attraktiven Preis anzubieten, und mit einem persönlichen Rabattcode zu sparen. Durch unser breites Sortiment an Neuwagen, ist es uns möglich Ihnen sämtliche Modelle zu präsentieren. Das Sparangebot gilt auf Sportwagen, <abbr>SUV</abbr> sowie Kastenwagen bei OXID eMotors.</p><p>Soll es eher sportlich, elegant und leistungsstark sein? Haben Sie spaß mit hoher Geschwindigkeit dem Alltag zu entfliehen? Dann können Sie sich in dem Bereich der neusten Sportwägen umsehen.<font color=\"#f7f7f7\" style=\"\"> <a href=\"/Sportwagen/\" target=\"_blank\" style=\"\">Hier zum Sportwagen</a></font></p>\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    Suchen Sie ein dynamisch, sportliches und vor allem in der Sicherheit überzeugendes Fahrzeug für Sie und Ihre Familie? Die breite Auswahl an <abbr>SUV</abbr>s wird Sie hier sicherlich überzeugen.\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <p>Soll es eher praktisch, geräumig und für Transporte geeignet sein? Dann empfiehlt sich ein Modell aus unserer Kategorie der Kastenwägen.</p>\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <div><span style=\"font-size: 18px;\"><b>Rabattaktion</b> </span><b>- so funktionierts!</b></div><div><br></div><div>Die Rabattaktion kann aktiviert werden, sobald das Kontaktformular mit einer Anfrage ausgefüllt wurde und Sie ein Beratungsgespräch wahrnehmen. Wenn Sie schnell sind, können Sie weitere Benefits genießen. Zu den ausgewählten Benefits gehören unter anderem eine einmalige Reinigung Ihres Neuwagens, eine Grundausstattung in bester Qualität sowie eine zusätzliche Versicherung gegen Unwetterschäden und vieles mehr. Informieren Sie sich jetzt und lassen Sie sich die einmalige Chance nicht entgehen.</div><div><br></div><div>Das Angebot gilt nur für Neukunden, durch den Kauf eines Neuwagens und ist ausschließlich bis zum 20.04.2023\r\n gültig.</div><div><br></div><div>Jetzt direkt ein Beratungsgespräch mit OXID eMotors vereinbaren und mit der Planung Ihres Traumfahrzeuges sowie dem attraktiven Sparangebot mit bis zu 20% durchstarten</div><div><br></div><div><a href=\"/kontakt/\" target=\"_blank\">Hier zum Kontaktformular</a></div>\r\n</div></div></div></div>','Attractive savings','<div class=\"container-fluid dd-ve-container clearfix\"><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <h2>We love to save - Do you too?</h2>\r\n<p>Fulfill your dream of owning a vehicle with us. Configure your desired model according to your preferences and activate your personal discounts. We are happy to always offer you the latest new cars at an attractive price, and to save with a personal discount code. With our wide range of new cars, we can present you with all models. The savings offer applies to sports cars, <abbr>SUV</abbr>s, and vans at OXID eMotors.</p>\r\n<p>Looking for something more sporty, elegant, and powerful? Do you enjoy escaping everyday life with high speed? Then you can browse the latest sports cars.</p><p><a href=\"/en/sports-car-the-fast-powerful-and-stylish-car/\" target=\"_blank\">Here for the sports car</a></p>\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    Are you looking for a dynamic, sporty and, above all, convincing in terms of safety vehicle for you and your family? The wide selection of <abbr>SUV</abbr>s will certainly convince you here.\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <p>Should it be more practical, spacious and suitable for transport? Then a model from our category of box wagons is recommended.</p>\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <p>The discount promotion can be activated once the contact form has been filled out with an inquiry and you have attended a consultation. If you act quickly, you can enjoy additional benefits. Selected benefits include a one-time cleaning of your new car, high-quality basic equipment, additional insurance against storm damage, and much more. Get informed now and don\'t miss this unique opportunity.</p><p>The offer is only valid for new customers through the purchase of a new car and is exclusively valid until 2023-04-20\r\n.<br></p><div>Now schedule a consultation with OXID eMotors and get started with planning your dream vehicle and the attractive savings offer of up to 20%.<p></p><p><a href=\"/en/contact/\" target=\"_blank\">Click here for the contact form</a></p></div>\r\n</div></div></div></div>',0,'','',0,'','','d78d622962801f00b5dc5149d92b0882','','','2023-04-06 10:47:30'),('94edc79bf3c746037b35d9e71180b9e3','nexa_x3_blueeagle',1,1,0,1,1,'','OXID eMotor Nexa X3 - BlueEagle – Ab sofort auch in blau ','<div class=\"container-fluid dd-ve-container clearfix\"><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <h2><span style=\"font-size: 18px;\">Den neuen Nexa X3 gibt es jetzt auch in Blau!</span></h2><p>Nexa X3 - BlueEagle ist ein Hochleistungswagen, der von einem tiefen Blau geprägt und mit schwarzen Akzenten und markanten Linien kontrastiert ist. Mit seinem neuen Design hebt sich der BlueEagle von der Masse ab und zieht alle Blicke auf sich. Der Innenraum ist mit luxuriösem Leder ausgestattet und sorgt für ein hochwertiges und modernes Ambiente. Der Sitz ist aus feinstem Alcantara gefertigt und bietet eine hervorragende Unterstützung und Polsterung. Mit der Verwendung von Sensoren und Fahrerassistenzsystemen ist ein sicheres und angenehmes Fahrerlebnis garantiert.</p><h2>Nexa X3 - <span style=\"font-size: 18px;\">BlueEagle Sportback Design</span></h2><p>Mit ein wenig sportlichen Designoptionen können Sie ganz einfach aus dem Nexa X3 - BlueEagle Modell eine Sportline machen. Ersetzen Sie Scheinwerfer durch schmale, kantige Scheinwerfer mit exklusiver LED-Beleuchtung und Hightech-Elementen, das gibt Ihrem Auto ein agiles Statement. Ändern Sie Felgen durch hochwertiges Aluminium oder Kohlefaser und wählen Sie Ihre Farbe selbst aus, um Ihr Fahrzeug zu individualisieren. Mit den hochwertigen und atmungsaktiven Sportsitzen in feinstem Carbon schwarz/blau oder schwarz/elfenbeinweiß wird die sportliche Exklusivität unterstrichen. Zusätzlich können Sie Ihre Einstiegsleiste mit einem Schriftzug individualisieren lassen oder durch schimmernden Lichteinfall spezielle Akzente setzen.<br></p>\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-4 col-xs-12\">\r\n\r\n\r\n    \r\n\r\n<div class=\"dd-shortcode-image dd-image-box my-4\">\r\n    <div class=\"card text-white bg-transparent\">\r\n        <img loading=\"lazy\" src=\"/out/pictures/ddmedia/Design ohne Titel (2) Kopie_2.jpg\" width=\"1500\" height=\"800\" alt=\"Ansicht von hinten links\" style=\"display: block; max-width: 100%; height: auto; margin: 0 auto;\">\r\n                            <a href=\"/out/pictures/ddmedia/Design ohne Titel (2) Kopie_2.jpg\" class=\"stretched-link\" data-toggle=\"lightbox\" aria-label=\"Bild 1 vergrößern\"></a>\r\n            </div>\r\n</div>\r\n\r\n</div><div class=\"col-sm-4 col-xs-12\">\r\n\r\n\r\n    \r\n\r\n<div class=\"dd-shortcode-image dd-image-box my-4\">\r\n    <div class=\"card text-white bg-transparent\">\r\n        <img loading=\"lazy\" src=\"/out/pictures/ddmedia/Design ohne Titel (2) Kopie 2_2.jpg\" width=\"1500\" height=\"800\" alt=\"Ansicht von links\" style=\"display: block; max-width: 100%; height: auto; margin: 0 auto;\">\r\n                            <a href=\"/out/pictures/ddmedia/Design ohne Titel (2) Kopie 2_2.jpg\" class=\"stretched-link\" data-toggle=\"lightbox\" aria-label= \"Bild 2 vergrößern\"></a>\r\n            </div>\r\n</div>\r\n\r\n</div><div class=\"col-sm-4 col-xs-12\">\r\n\r\n\r\n    \r\n\r\n<div class=\"dd-shortcode-image dd-image-box my-4\">\r\n    <div class=\"card text-white bg-transparent\">\r\n        <img loading=\"lazy\" src=\"/out/pictures/ddmedia/Design ohne Titel (2) Kopie 3_2.jpg\" width=\"1500\" height=\"800\" alt=\"Ansicht vorne links\" style=\"display: block; max-width: 100%; height: auto; margin: 0 auto;\">\r\n                            <a href=\"/out/pictures/ddmedia/Design ohne Titel (2) Kopie 3_2.jpg\" class=\"stretched-link\" data-toggle=\"lightbox\" aria-label=\"Bild 3 vergrößern\"></a>\r\n            </div>\r\n</div>\r\n\r\n</div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <h2><span style=\"font-size: 18px;\">Ausstattungshighlights</span></h2><ul><li>Multimedia-Display 10,5\"</li><li>Digitales Cockpit 12,3\"</li><li>OXID eMotor Safety Sense</li><li>Geschwindigkeitsregelanlage, adaptiv mit Stop&amp;Go</li><li>Klimaautomatik, 2-Zonen</li><li>Lederlenkrad, beheizt</li><li>Höhenverstellung für Fahrer- und Beifahrersitz</li><li><span style=\"font-size: 14px;\">16“ Leichtmetallfelgen</span></li></ul><h2><span style=\"font-size: 18px;\">Finanzierung und Leasing für den Nexa X3</span></h2><p>Sie möchten den Nexa X3 - BlueEagle haben, aber schwanken zwischen einer Finanzierung und einem Leasing? Wir helfen Ihnen bei der Entscheidung, denn jedes unserer Angebote wird individuell an Bedürfnisse und Wünsche angepasst. Erfahren Sie jetzt mehr über attraktive Finanzierungslösungen oder passende Leasingangebote für den Nexa X3 - BlueEagle<br></p><h2><span style=\"font-size: 18px;\">Jetzt Beratung vereinbaren</span></h2><p>Sie sind von unserem Nexa X3 - BlueEagle überzeugt und möchten vielleicht noch das Sportbackdesign dazu buchen? Dann sichern Sie sich jetzt einen Termin bei einem unserer Experten. Sie helfen Ihnen bei Fragen, weiteren Informationen oder konkreten Angeboten. Unsere OXID eMotor Servicemitarbeiter beraten Sie gerne individuell per Telefon oder direkt vor Ort.</p><p><br><button type=\"button\" class=\"btn-primary\"><a href=\"/kontakt/\" target=\"_blank\">Termin vereinbaren</a></button><br></p>\r\n</div></div></div></div>','OXID eMotor Nexa X3 - BlueEagle - Now also available in blue','<div class=\"container-fluid dd-ve-container clearfix\"><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <h2>The new Nexa X3 is now also available in blue.</h2>\r\n<p>Nexa X3 - BlueEagle is a high-performance car characterized by a deep blue color and contrasted with black accents and striking lines. With its new design, the BlueEagle stands out from the crowd and catches everyone\'s eye. The interior features luxurious leather for a premium and modern ambiance. The seat is made of the finest Alcantara and provides excellent support and cushioning. With the use of sensors and driver assistance systems, a safe and enjoyable driving experience is guaranteed.</p>\r\n<h2>Nexa X3 - BlueEagle Sportback Design.</h2>\r\n<p>With a little sporty design options, you can easily turn the Nexa X3 - BlueEagle model into a Sportline. Replace headlights with narrow, angular headlights with exclusive LED lighting and high-tech elements, this will give your car an agile statement. Change rims with high-quality aluminum or carbon fiber and choose your own color to customize your vehicle. Underline the sporty exclusivity with the high-quality and breathable sports seats in finest carbon black/blue or black/ivory white. In addition, you can have your door sill individualized with a lettering or set special accents by shimmering light incidence.</p>\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-4 col-xs-12\">\r\n\r\n\r\n    \r\n\r\n<div class=\"dd-shortcode-image dd-image-box my-4\">\r\n    <div class=\"card text-white bg-transparent\">\r\n        <img loading=\"lazy\" src=\"/out/pictures/ddmedia/Design ohne Titel (2) Kopie_2.jpg\" width=\"1500\" height=\"800\" alt=\"View from the left behind\" style=\"display: block; max-width: 100%; height: auto; margin: 0 auto;\">\r\n                            <a href=\"/out/pictures/ddmedia/Design ohne Titel (2) Kopie_2.jpg\" class=\"stretched-link\" data-toggle=\"lightbox\" aria-label=\"Enlarge image 1\"></a>\r\n            </div>\r\n</div>\r\n\r\n</div><div class=\"col-sm-4 col-xs-12\">\r\n\r\n\r\n    \r\n\r\n<div class=\"dd-shortcode-image dd-image-box my-4\">\r\n    <div class=\"card text-white bg-transparent\">\r\n        <img loading=\"lazy\" src=\"/out/pictures/ddmedia/Design ohne Titel (2) Kopie 2_2.jpg\" width=\"1500\" height=\"800\" alt=\"View from the left\" style=\"display: block; max-width: 100%; height: auto; margin: 0 auto;\">\r\n                            <a href=\"/out/pictures/ddmedia/Design ohne Titel (2) Kopie 2_2.jpg\" class=\"stretched-link\" data-toggle=\"lightbox\" aria-label=\"Enlarge image 2\"></a>\r\n            </div>\r\n</div>\r\n\r\n</div><div class=\"col-sm-4 col-xs-12\">\r\n\r\n\r\n    \r\n\r\n<div class=\"dd-shortcode-image dd-image-box my-4\">\r\n    <div class=\"card text-white bg-transparent\">\r\n        <img loading=\"lazy\" src=\"/out/pictures/ddmedia/Design ohne Titel (2) Kopie 3_2.jpg\" width=\"1500\" height=\"800\" alt=\"View from the left front\" style=\"display: block; max-width: 100%; height: auto; margin: 0 auto;\">\r\n                            <a href=\"/out/pictures/ddmedia/Design ohne Titel (2) Kopie 3_2.jpg\" class=\"stretched-link\" data-toggle=\"lightbox\" aria-label=\"Enlarge image 3\"></a>\r\n            </div>\r\n</div>\r\n\r\n</div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <h2>Equipment highlights</h2>\r\n<ul>\r\n  <li>Multimedia display 10.5\"</li>\r\n  <li>Digital cockpit 12.3\"</li>\r\n  <li>OXID eMotor Safety Sense</li>\r\n  <li>Adaptive cruise control with Stop&amp;Go</li>\r\n  <li>2-zone automatic climate control</li>\r\n  <li>Heated leather steering wheel</li>\r\n  <li>Height adjustment for driver and front passenger seat</li>\r\n  <li>16\" alloy wheels</li>\r\n</ul>\r\n<h2>Financing and leasing for Nexa X3</h2>\r\n<p>Want to have the Nexa X3 - BlueEagle but can\'t decide between financing and leasing? We can help you make the decision, as each of our offers is tailored to your needs and wishes. Find out more about attractive financing solutions or suitable leasing offers for the Nexa X3 - BlueEagle.</p>\r\n<h2>Schedule a consultation now</h2>\r\n<p>Are you convinced of our Nexa X3 - BlueEagle and would like to add the Sportback design? Then book an appointment now with one of our experts. They will help you with questions, further information, or specific offers. Our OXID eMotor service staff will be happy to advise you individually by phone or directly on site.</p>\r\n<p><br><a href=\"/en/contact/\" target=\"_blank\" class=\"btn btn-primary\">Schedule an appointment</a><br></p>\r\n</div></div></div></div>',0,'','',0,'','','d78d622962801f00b5dc5149d92b0882','','','2023-04-19 13:57:59'),('a357216ea522684255da72cc908714e3','felgenzumhalbenpreis',1,1,0,1,1,'','Felgen zum halben Preis','<div class=\"container-fluid dd-ve-container clearfix\"><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <h2>Felgen bis zu 50% reduziert</h2><p>In Kombination mit dem Kauf eines Neuwagens, erhalten Sie die einmalige Chance von unserem Komplettangebot, welches fertig montierte und gewuchtete Kompletträder beinhaltet. Doch das Beste kommt erst noch – die Felgen dürfen individuell ausgesucht werden und zum halben Preis erworben werden. Daher bietet sich Ihnen die Möglichkeit, erstklassige Felgen bis zu 50% reduziert zu einem Neuwagen Ihrer Wahl zu erhalten.&nbsp;</p>\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\">    \r\n\r\n\r\n\r\n    \r\n\r\n<div class=\"dd-shortcode-gallery dd-image-gallery\">\r\n    <div class=\"row\">\r\n                    <div class=\"col-12 col-sm-4\">\r\n                <div class=\"card text-white bg-transparent dd-image-box\">\r\n                    <img loading=\"lazy\" src=\"/out/pictures/ddmedia/Felge1.jpg\" width=\"1500\" height=\"700\" alt=\"Felge1.jpg\" style=\"display: block; max-width: 100%; height: auto; margin: 0 auto;\">\r\n                                        <a href=\"/out/pictures/ddmedia/Felge1.jpg\" class=\"stretched-link\" target=\"_blank\" data-toggle=\"lightbox\" data-gallery=\"gallery_643fccc47a475\"></a>\r\n                </div>\r\n            </div>\r\n                    <div class=\"col-12 col-sm-4\">\r\n                <div class=\"card text-white bg-transparent dd-image-box\">\r\n                    <img loading=\"lazy\" src=\"/out/pictures/ddmedia/Felge2.jpg\" width=\"1500\" height=\"700\" alt=\"Felge2.jpg\" style=\"display: block; max-width: 100%; height: auto; margin: 0 auto;\">\r\n                                        <a href=\"/out/pictures/ddmedia/Felge2.jpg\" class=\"stretched-link\" target=\"_blank\" data-toggle=\"lightbox\" data-gallery=\"gallery_643fccc47a475\"></a>\r\n                </div>\r\n            </div>\r\n                    <div class=\"col-12 col-sm-4\">\r\n                <div class=\"card text-white bg-transparent dd-image-box\">\r\n                    <img loading=\"lazy\" src=\"/out/pictures/ddmedia/Felge3.jpg\" width=\"1500\" height=\"700\" alt=\"Felge3.jpg\" style=\"display: block; max-width: 100%; height: auto; margin: 0 auto;\">\r\n                                        <a href=\"/out/pictures/ddmedia/Felge3.jpg\" class=\"stretched-link\" target=\"_blank\" data-toggle=\"lightbox\" data-gallery=\"gallery_643fccc47a475\"></a>\r\n                </div>\r\n            </div>\r\n        \r\n    </div>\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <><span style=\"font-size: 18px;\"><b>Welche Felge passt zu Ihnen?</b></span></><p>Hier finden Sie eine grenzenlose Auswahl aus Felgen die perfekt zu Ihrem ausgewählten Fahrzeug passen. Felgen erst dann zu kaufen, wenn sie beschädigt sind, halten wir nicht für sinnvoll. Neue Felgen sind gerade bei einem Neuwagen inklusive den neuen Kompletträdern zu empfehlen, oder auch aus ästhetischen Gründen, um das Fahrzeug aufzuwerten. Die Wahl der passenden Felge ist essenziell, um noch lange Freude daran zu haben. Wichtig ist es auf bestimmte Details zu achten, worauf genau es ankommt erfahren Sie anschließend.</p><p>Grundlegend muss entschieden werden aus welchem Material die Felge bestehen soll, hier gibt es entweder Alufelgen oder Stahlfelgen als Optionen. Zunächst wird weiter unterschieden zwischen Leichtmetall Felgen, einteilige Felgen oder den mehrteiligen Felgen.</p><p>Außerdem besteht die Möglichkeit zwischen der Felgenbreite,- Durchmesser,- Tiefe,- und vielem mehr zu Wählen. Auch verschiedene Farben wie Silber, Schwarz oder auch bunt sind möglich.</p><p>Die Vielfalt der Felgen bringt große Preisspannen mit sich, daher wird auf ausgewählte Felgen 50% gewährt, und auf das höherpreisige Sortiment zwischen 30-20%. In unserem Onlineshop können Sie sich die Auswahl anschauen, um zu sehen wie viele Prozente es auf die Felgen gibt, einfach den angegebenen Code verwenden.</p><h2>So günstig und doch so unkompliziert und gut</h2>\r\n<h3>Rabatt-Aktion</h3>\r\n<p>Unsere Aktion gilt bis zum 03.05.2023 und ist ausschließlich in Kombination mit dem Kauf eines Neuwagens gültig. Den Rabatt wird euch im Bestellvorgang gewährt.</p><p><a href=\"/kontakt/\" target=\"_blank\" class=\"btn btn-primary\">Jetzt Beratungsgespräch vereinbaren!</a></p>\r\n</div></div></div></div>','Rims for half price','<div class=\"container-fluid dd-ve-container clearfix\"><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    Wheels reduced up to 50%</><p>Combined with the purchase of a new car, you have the unique opportunity to take advantage of our complete package, which includes fully mounted and balanced wheels. But the best is yet to come - the wheels can be individually selected and purchased at half price. This offers you the opportunity to get first-class wheels reduced up to 50% with a new car of your choice.</p>\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\">    \r\n   \r\n<div class=\"dd-shortcode-gallery dd-image-gallery\">\r\n    <div class=\"row\">\r\n                    <div class=\"col-12 col-sm-4\">\r\n                <div class=\"card text-white bg-transparent dd-image-box\">\r\n                    <img loading=\"lazy\" src=\"/out/pictures/ddmedia/Felge1.jpg\" width=\"1500\" height=\"700\" alt=\"Felge1.jpg\" style=\"display: block; max-width: 100%; height: auto; margin: 0 auto;\">\r\n                                        <a href=\"/out/pictures/ddmedia/Felge1.jpg\" class=\"stretched-link\" target=\"_blank\" data-toggle=\"lightbox\" data-gallery=\"gallery_643fed4121c6a\" aria-label=\"Enlarge image 1\"></a>\r\n                </div>\r\n            </div>\r\n                    <div class=\"col-12 col-sm-4\">\r\n                <div class=\"card text-white bg-transparent dd-image-box\">\r\n                    <img loading=\"lazy\" src=\"/out/pictures/ddmedia/Felge2.jpg\" width=\"1500\" height=\"700\" alt=\"Felge2.jpg\" style=\"display: block; max-width: 100%; height: auto; margin: 0 auto;\">\r\n                                        <a href=\"/out/pictures/ddmedia/Felge2.jpg\" class=\"stretched-link\" target=\"_blank\" data-toggle=\"lightbox\" data-gallery=\"gallery_643fed4121c6a\" aria-label=\"Enlarge image 2\"></a>\r\n                </div>\r\n            </div>\r\n                    <div class=\"col-12 col-sm-4\">\r\n                <div class=\"card text-white bg-transparent dd-image-box\">\r\n                    <img loading=\"lazy\" src=\"/out/pictures/ddmedia/Felge3.jpg\" width=\"1500\" height=\"700\" alt=\"Felge3.jpg\" style=\"display: block; max-width: 100%; height: auto; margin: 0 auto;\">\r\n                                        <a href=\"/out/pictures/ddmedia/Felge3.jpg\" class=\"stretched-link\" target=\"_blank\" data-toggle=\"lightbox\" data-gallery=\"gallery_643fed4121c6a\" aria-label=\"Enlarge image 3\"></a>\r\n                </div>\r\n            </div>\r\n        \r\n    </div>\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <>Which rim suits you best?</>\r\n<p>Here you will find a boundless selection of rims that perfectly fit your chosen vehicle. We do not recommend buying new rims only when they are damaged. New rims are especially recommended for a new car, or for aesthetic reasons to upgrade the vehicle. Choosing the right rim is essential to have long-term enjoyment. It is important to pay attention to certain details, which you will learn about below.</p>\r\n<p>Fundamentally, it must be decided which material the rim should be made of, with the options being aluminum or steel rims. First, a further distinction is made between light metal rims, one-piece rims, or multi-piece rims.</p>\r\n<p>In addition, there is the possibility to choose between rim width, diameter, depth, and much more. Various colors such as silver, black, or even colorful options are also possible.</p>\r\n<p>The variety of rims comes with a large price range, which is why selected rims receive a 50% discount, and the higher-priced range receives between 30-20%. In our online shop, you can check out the selection to see how many percent off the rims have by using the indicated code.</p>\r\n<h2>So affordable yet so uncomplicated and good.</h2>\r\n<h3>Discount Promotion</h3>\r\n<p>Our promotion is valid until 2023-05-03 and is only valid in combination with the purchase of a new car. The discount will be granted during the ordering process.</p>\r\n<p><a href=\"/contact/\" target=\"_blank\" class=\"btn btn-primary\">Now schedule a consultation!</a></p>\r\n</div></div></div></div>',0,'','',0,'','','d78d622962801f00b5dc5149d92b0882','','','2023-04-19 13:47:15'),('ad542e49541c1add','oxupdatepassinfoemail',1,1,0,1,1,'','Ihr Passwort im eShop','Hallo {{  user.oxuser__oxsal.value|translate_salutation  }} {{  user.oxuser__oxfname.value  }} {{  user.oxuser__oxlname.value  }},\r\n<br /><br />\r\nöffnen Sie den folgenden Link, um ein neues Passwort für {{  shop.oxshops__oxname.value  }} einzurichten:\r\n<br /><br />\r\n<a href=\"{{  oViewConf.getBaseDir()  }}index.php?cl=forgotpwd&amp;uid={{  user.getUpdateId()  }}&amp;lang={{  oViewConf.getActLanguageId()  }}&amp;shp={{  shop.oxshops__oxid.value  }}\">{{  oViewConf.getBaseDir()  }}index.php?cl=forgotpwd&amp;uid={{  user.getUpdateId() }}&amp;lang={{  oViewConf.getActLanguageId()  }}&amp;shp={{  shop.oxshops__oxid.value  }}</a>\r\n<br /><br />\r\nDiesen Link können Sie innerhalb der nächsten {{  user.getUpdateLinkTerm() / 3600  }} Stunden aufrufen.\r\n<br /><br />\r\nIhr {{  shop.oxshops__oxname.value  }} Team\r\n<br />','password update info','Hello {{  user.oxuser__oxsal.value|translate_salutation  }} {{  user.oxuser__oxfname.value  }} {{  user.oxuser__oxlname.value  }},<br />\r\n<br />\r\nfollow this link to generate a new password for {{  shop.oxshops__oxname.value  }}:<br />\r\n<br /><a href=\"{{  oViewConf.getBaseDir()  }}index.php?cl=forgotpwd&amp;uid={{  user.getUpdateId()  }}&amp;lang={{  oViewConf.getActLanguageId()  }}&amp;shp={{  shop.oxshops__oxid.value  }}\">{{  oViewConf.getBaseDir()  }}index.php?cl=forgotpwd&amp;uid={{  user.getUpdateId() }}&amp;lang={{  oViewConf.getActLanguageId()  }}&amp;shp={{  shop.oxshops__oxid.value  }}</a><br />\r\n<br />\r\nYou can use this link within the next {{  user.getUpdateLinkTerm() / 3600  }} hours.<br />\r\n<br />\r\nYour {{  shop.oxshops__oxname.value  }} team<br />',1,'','',1,'','','30e44ab83fdee7564.23264141','CMSFOLDER_EMA