in touch with the periodic {{  oxcmp_shop.oxshops__oxname.value  }}-newsletter every couple of weeks. We gladly inform you about recent tips, promotions and new products.</p>\r\n<p>You can unsubscribe any time from the newsletter.</p>\r\n<p>We strictly refuse <span class=\"newsletter_title\">transferring your data to 3rd parties</span>.</p>\r\n<p>For subscription we use the so called &quot;double opt-in&quot; procedure to guarantee that no unauthorized person will register with your e-mail address.</p>',1,'','',1,'','','30e44ab83fdee7564.23264141','CMSFOLDER_USERINFO','','2023-04-25 10:17:00'),('f9ec73747172e572eecadd75d1239200','schnelleundleistungsstarkeautos',1,1,0,1,1,'','Sportwagen das schnelle, leistungsstarke und stilvolle Auto','<div class=\"container-fluid dd-ve-container clearfix\"><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <p>Sportwagen sind schnelle, leistungsstarke und stilvolle Autos, welche für ihre sportliche Leistung und ihr auffälliges Design bekannt sind.</p>\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\">\r\n\r\n\r\n    \r\n\r\n<div class=\"dd-shortcode-image dd-image-box my-4\">\r\n    <div class=\"card text-white bg-transparent\">\r\n        <img loading=\"lazy\" src=\"/out/pictures/ddmedia/Design ohne Titel (2).jpg\" width=\"1500\" height=\"660\" alt=\"\">\r\n                            <a href=\"/out/pictures/ddmedia/Design ohne Titel (2).jpg\" class=\"stretched-link\" target=\"_blank\" data-toggle=\"lightbox\" aria-label=\"Blaue Version - Bild allein anzeigen\"></a>\r\n            </div>\r\n</div>\r\n\r\n</div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <h3>Ein Sportwagen ist so viel mehr als nur ein Auto</h3><div>Vor allem bringen sie die Liebe des Fahrers zur Geschwindigkeit, Kontrolle und Schönheit des Wagens zum Ausdruck. Generell wird die Begeisterung für diese Art von Autos aus dem Adrenalinfaktor gewonnen. Durch die Schnelligkeit und die alleinige Kontrolle über das Fahrzeug steigt der Nervenkitzel dementsprechend an. Dem Alltag durch die hohe Geschwindigkeit entfliehen war noch nie so einfach und attraktiv, daher sind Sportwagen für viele eine Legende, auch auf Grund des auffälligen Designs. Durch das einzigartige, aufregende und unverwechselbare Fahrerlebnis wird ein Sportwagen eine Erinnerung schaffen, an die man sich noch eine lange Zeit erinnern wird und nicht mehr missen möchte.</div><h3>Geschwindigkeit, Spaß und Emotionen</h3><div>Sportwagen sind in erster Linie Personenkraftwagen, bei welchen es darauf ankommt, den Kontakt zur Straße so gut es geht zu fühlen, und den Abstand so gering wie möglich zu halten. Auch das gesamte Gewicht spielt eine große Rolle, jedes überflüssige Kilogramm ist eins zu viel. Daher haben diese Fahrzeuge ein geringeres Gewicht gegenüber herkömmlichen PKWs und eine überdurchschnittliche Motorleistung. Das Gesamtpaket macht es aus, passende und bequeme Sitze, spezielle Bremsen und Achtzylindermotore runden die ganze Sache ab. Durch verschiedene Möglichkeiten gegen einen nach oben unbestimmtem Preis, wird das Fahrerlebnis noch intensiver gestaltet. Ein Hochleistungs-Automotor verwendet oft fortschrittliche Technologien wie eine variable Ventilsteuerung, um die Luftzufuhr und -abgabe zu optimieren und die Leistung zu erhöhen. Der Motor kann auch mit einer Hochleistungskühlung, einer verbesserten Kraftstoffzufuhr und einem verbesserten Abgassystem ausgestattet sein. Das Design ist auf maximale Effizienz bei der Luftströmung ausgelegt. Durch die Nähe zur Straße wird der Luftwiderstand minimiert und die Energieeffizienz verbessert, indem sie den Kraftstoffverbrauch senkt und die Geschwindigkeit erhöht.<br></div>\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\">    \r\n\r\n\r\n\r\n    \r\n\r\n<div class=\"dd-shortcode-gallery dd-image-gallery\">\r\n    <div class=\"row\">\r\n                    <div class=\"col-12 col-sm-6\">\r\n                <div class=\"card text-white bg-transparent dd-image-box\">\r\n                    <img loading=\"lazy\" src=\"/out/pictures/ddmedia/Design ohne Titel (4).jpg\" width=\"1500\" height=\"800\" alt=\"Design ohne Titel (4).jpg\" style=\"vertical-align: middle;max-width: 100%;height: auto;overflow: hidden;\">\r\n                                        <a href=\"/out/pictures/ddmedia/Design ohne Titel (4).jpg\" class=\"stretched-link\" target=\"_blank\" data-toggle=\"lightbox\" data-gallery=\"gallery_643fb9e578e3a\" aria-label=\"Rote Version - Bild allein anzeigen\"></a>\r\n                </div>\r\n            </div>\r\n                    <div class=\"col-12 col-sm-6\">\r\n                <div class=\"card text-white bg-transparent dd-image-box\">\r\n                    <img loading=\"lazy\" src=\"/out/pictures/ddmedia/Design ohne Titel (5).jpg\" width=\"1500\" height=\"800\" alt=\"Design ohne Titel (5).jpg\" style=\"vertical-align: middle;max-width: 100%;height: auto;overflow: hidden;\">\r\n                                        <a href=\"/out/pictures/ddmedia/Design ohne Titel (5).jpg\" class=\"stretched-link\" target=\"_blank\" data-toggle=\"lightbox\" data-gallery=\"gallery_643fb9e578e3a\" aria-label=\"Schwarze Version - Bild allein anzeigen\"></a>\r\n                </div>\r\n            </div>\r\n        \r\n    </div>\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <h3>Ihre Möglichkeiten</h3><div>Viele sind der Ansicht, dass der Fahrspaß im Vordergrund stehen sollte, dabei wird oft vergessen, dass eine Finanzierung nicht für jedermann möglich ist. Durch unser attraktives Leasing Angebot wird die Möglichkeit geboten, mithilfe einer individuellen Anzahlungssumme sich den Wunsch zu einem eigenen Sportwagen zu erfüllen. Durch unser angepasstes und individuell zugeschnittenes Angebot bietet sich Ihnen eine Reihe an Optionen.&nbsp;&nbsp;</div><div><br></div><div>Jetzt direkt informieren und ein <a href=\"/kontakt/\" target=\"_blank\" class=\"btn btn-primary\">Beratungsgespräch vereinbaren</a>.</div><div><br></div>\r\n</div></div></div></div>','Sports car - the fast, powerful and stylish car','<div class=\"container-fluid dd-ve-container clearfix\"><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <font color=\"#000000\" face=\"Calibri, Calibri_EmbeddedFont, Calibri_MSFontService, sans-serif\"><span style=\"font-size: 16px; font-variant-ligatures: none; white-space: pre-wrap;\">Sports cars are fast, powerful and stylish cars which are known for their sporty performance and eye-catching design.</span></font><br>\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\">\r\n\r\n\r\n    \r\n\r\n<div class=\"dd-shortcode-image dd-image-box my-4\">\r\n    <div class=\"card text-white bg-transparent\">\r\n        <img loading=\"lazy\" src=\"/out/pictures/ddmedia/Design ohne Titel (2).jpg\" width=\"1500\" height=\"660\" alt=\"\">\r\n                            <a href=\"/out/pictures/ddmedia/Design ohne Titel (2).jpg\" class=\"stretched-link\" data-toggle=\"lightbox\" aria-label=\"Blue variant - Show image separately\"></a>\r\n            </div>\r\n</div>\r\n\r\n</div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <h2>A sports car is so much more than just a car</h2>\r\n<div>Above all, they express the driver\'s love for speed, control and beauty of the car. Generally, the enthusiasm for these types of cars is derived from the adrenaline factor. Due to the speed and the sole control of the vehicle, the thrill increases accordingly. Escape from everyday life through high speed has never been so easy and attractive, so sports cars are a legend for many, also due to the eye-catching design. Through the unique, exciting and distinctive driving experience, a sports car will create a memory that will be remembered for a long time and will not be missed.</div>\r\n<h2>Speed, fun and emotion</h2>\r\n<div>Sports cars are first and foremost passenger cars, in which it is important to feel the contact with the road as much as possible, and to keep the distance as small as possible. The overall weight also plays a major role; every excess kilogram is one too many. That\'s why these vehicles have a lower weight than conventional passenger cars and above-average engine performance. The whole package makes it, suitable and comfortable seats, special brakes and eight-cylinder engines complete the whole thing. Through various options against an upwardly indefinite price, the driving experience is made even more intense. A high-performance car engine often uses advanced technologies like variable valve timing to optimize airflow and delivery and increase power. Der Motor kann auch mit einer Hochleistungskühlung, einer verbesserten Kraftstoffzufuhr und einem verbesserten Abgassystem ausgestattet sein. The design is engineered for maximum airflow efficiency. Proximity to the road minimizes drag and improves energy efficiency by reducing fuel consumption and increasing speed.</div>\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\">    \r\n\r\n\r\n\r\n    \r\n\r\n<div class=\"dd-shortcode-gallery dd-image-gallery\">\r\n    <div class=\"row\">\r\n                    <div class=\"col-12 col-sm-6\">\r\n                <div class=\"card text-white bg-transparent dd-image-box\">\r\n                    <img loading=\"lazy\" src=\"/out/pictures/ddmedia/Design ohne Titel (4).jpg\" width=\"1500\" height=\"800\" alt=\"Design ohne Titel (4).jpg\" style=\"vertical-align: middle;max-width: 100%;height: auto;overflow: hidden;\">\r\n                                        <a href=\"/out/pictures/ddmedia/Design ohne Titel (4).jpg\" class=\"stretched-link\" target=\"_blank\" data-toggle=\"lightbox\" data-gallery=\"gallery_643fe23632ea5\" aria-label=\"Red variant - Show image separately\"></a>\r\n                </div>\r\n            </div>\r\n                    <div class=\"col-12 col-sm-6\">\r\n                <div class=\"card text-white bg-transparent dd-image-box\">\r\n                    <img loading=\"lazy\" src=\"/out/pictures/ddmedia/Design ohne Titel (5).jpg\" width=\"1500\" height=\"800\" alt=\"Design ohne Titel (5).jpg\" style=\"vertical-align: middle;max-width: 100%;height: auto;overflow: hidden;\">\r\n                                        <a href=\"/out/pictures/ddmedia/Design ohne Titel (5).jpg\" class=\"stretched-link\" target=\"_blank\" data-toggle=\"lightbox\" data-gallery=\"gallery_643fe23632ea5\" aria-label=\"Black variant - Show image separately\"></a>\r\n                </div>\r\n            </div>\r\n        \r\n    </div>\r\n</div></div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text \">\r\n    <h3>Your possibilities</h3><div>Many people believe that driving pleasure should be the main priority, but often forget that financing is not possible for everyone. Our attractive leasing offer provides the opportunity to fulfill the desire to own a sports car with the help of an individual down payment amount. Our customized and individually tailored offer provides you with a range of options.</div>\r\n<div>Get information right now and <a class=\"btn btn-primary\" href=\"/en/contact/\" target=\"_blank\">arrange a consultation</a>.</div>\r\n</div></div></div></div>',0,'','',0,'','','d78d622962801f00b5dc5149d92b0882','','','2023-04-19 12:45:43'),('fe2220e28ff931c268f0d8321eb74994','oxstartslot4',1,1,0,1,1,'','Startpage Intro-Teaser 4','<div class=\"container-fluid dd-ve-container clearfix\"><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text-image-row style-4 space-0\">\r\n    <div class=\"container-xxl\">\r\n        <div class=\"card\">\r\n                <div class=\"row g-0 m-0\">\r\n                    <div class=\"col-lg-7\">\r\n                        <img src=\"/out/pictures/ddmedia/Auto_03_Mood.jpg\" class=\"card-img card-img-full\" alt=\"Das sind wir\" width=\"2000\" height=\"1500\">\r\n                    </div>\r\n                    <div class=\"col-lg-5\">\r\n                        <div class=\"card-body\">\r\n                            <div class=\"card-title h2\">Das sind wir</div>\r\n                            <div class=\"card-text\"><p>OXID eMotors ist ein führender Hersteller von Fahrzeugen, Ersatzteilen und Zubehör für alle Arten von Autofahrern. Wir bieten eine breite Palette von Produkten, die sowohl die Bedürfnisse von Fahrern als auch von Enthusiasten erfüllen.\r\n</p><p>\r\nUnser Ziel ist es, qualitativ hochwertige Produkte zu einem erschwinglichen Preis anzubieten, um sicherzustellen, dass jeder eine perfekte Fahrt genießen kann. Bei OXID eMotors dreht sich alles um Leistung, Qualität und Stil.</p></div>\r\n                            <span class=\"btn btn-outline-primary\">Jetzt anschauen</span>\r\n                        </div>\r\n                    </div>\r\n                    <a href=\"/Impressum/\" class=\"stretched-link\" aria-label=\"Jetzt anschauen\"></a>\r\n                </div>\r\n            </div>\r\n            </div>\r\n</div>\r\n</div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text-image-row style-3 space-0\">\r\n            \r\n    <div class=\"container-xxl\">\r\n                                <div class=\"card\">\r\n                <div class=\"row g-0 m-0\">\r\n                    <div class=\"col-lg-6 order-lg-2\">\r\n                        <img src=\"/out/pictures/ddmedia/Car_03_Mood.jpg\" class=\"card-img card-img-full\" alt=\"Kundenservice\" width=\"2000\" height=\"1500\">\r\n                    </div>\r\n                    <div class=\"col-lg-6 order-lg-1\">\r\n                        <div class=\"card-body\">\r\n                            <div class=\"card-title h2\">Kundenservice</div>\r\n                            <div class=\"card-text\">Unser Kundenservice steht Ihnen jederzeit mit Rat und Tat zur Seite. Wir legen großen Wert auf eine individuelle Betreuung und möchten sicherstellen, dass jeder Kunde mit einem Lächeln auf dem Gesicht unser Geschäft verlässt. Unsere Experten sind jederzeit für Sie erreichbar, um Ihre Fragen zu beantworten und Sie bei allen Anliegen zu unterstützen. Wir sind stolz darauf, unseren Kunden ein rundum zufriedenstellendes Erlebnis bieten zu können und freuen uns auf Ihre Anfragen.</div>\r\n                            <span class=\"btn btn-outline-primary\">Jetzt informieren</span>\r\n                        </div>\r\n                    </div>\r\n                    <a href=\"/Kundenservice/\" class=\"stretched-link\" aria-label=\"Jetzt informieren\"></a>\r\n                </div>\r\n            </div>\r\n\r\n            </div>\r\n</div>\r\n</div></div></div>','Startpage Intro-Teaser 4','<div class=\"container-fluid dd-ve-container clearfix\"><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text-image-row style-4 space-0\">\r\n            \r\n    <div class=\"container-xxl\">\r\n                                <div class=\"card\">\r\n                <div class=\"row g-0 m-0\">\r\n                    <div class=\"col-lg-7\">\r\n                        <img src=\"/out/pictures/ddmedia/SportsCar_Sc1.jpg\" class=\"card-img card-img-full\" alt=\"This is us\" width=\"2000\" height=\"1500\">\r\n                    </div>\r\n                    <div class=\"col-lg-5\">\r\n                        <div class=\"card-body\">\r\n                            <div class=\"card-title h2\">This is us</div>\r\n                            <div class=\"card-text\"><p>OXID eMotors is a leading manufacturer of vehicles, spare parts and accessories for all types of drivers. We offer a wide range of products that meet the needs of both drivers and enthusiasts.>/p><p>Our goal is to provide high-quality products at an affordable price to ensure that everyone can enjoy a perfect ride. OXID eMotors is all about performance, quality and style.</p></div>\r\n                            <span class=\"btn btn-outline-primary\">View now</span>\r\n                        </div>\r\n                    </div>\r\n                    <a href=\"/en/About-Us/\" class=\"stretched-link\" aria-label=\"View now\"></a>\r\n                </div>\r\n            </div>\r\n            </div>\r\n</div>\r\n</div></div><div class=\"row\"><div class=\"col-sm-12 col-xs-12\"><div class=\"dd-shortcode-text-image-row style-3 space-0\">\r\n            \r\n    <div class=\"container-xxl\">\r\n                                <div class=\"card\">\r\n                <div class=\"row g-0 m-0\">\r\n                    <div class=\"col-lg-6 order-lg-2\">\r\n                        <img src=\"/out/pictures/ddmedia/SportsCar_Sc1.jpg\" class=\"card-img card-img-full\" alt=\"Customer service\" width=\"2000\" height=\"1500\">\r\n                    </div>\r\n                    <div class=\"col-lg-6 order-lg-1\">\r\n                        <div class=\"card-body\">\r\n                            <div class=\"card-title h2\">Customer service</div>\r\n                            <div class=\"card-text\"><p>Our customer service is always there to help and advise you. We place great value on individual attention and want to ensure that every customer leaves our store with a smile on their face. Our experts are always available to answer your questions and assist you with any concerns. We pride ourselves on providing our customers with an all-around satisfying experience and look forward to hearing from you.</p></div>\r\n                            <span class=\"btn btn-outline-primary\">View now</span>\r\n                        </div>\r\n                    </div>\r\n                    <a href=\"/en/Customer-service/\" class=\"stretched-link\" aria-label=\"View now\"></a>\r\n                </div>\r\n            </div>\r\n\r\n            </div>\r\n</div>\r\n</div></div></div>',0,'','',0,'','','d78d622962801f00b5dc5149d92b0882','','','2023-04-06 06:42:48');
