l at first if this axle body would fit in my vehicle, but the installation was very simple and straightforward. However, the price is a bit high for a spare part.','46373192-723c-4bf7-a0f6-e90e3058','2023-03-30 11:23:29',1,4,'2023-03-30 09:23:29'),('1523479a59c509ca3889d9ed7d94f72b',0,'cadd3f6b268e8def56c14aa370ff7f62','oxarticle','Da ich viel auf Geschäftsreisen unterwegs bin, brauchte ich einen Koffer welcher Kompakt ist und viel Stauraum bietet! Und genau das erfüllt dieser Trolley. Da ich ihn schon oft in Gebrauch hatte, kann ich sagen, er ist sehr belastbar und bruchfest im Gegensatz zu günstigen Koffern! Praktisch finde ich vorallem die kleine Fronttasche um persönliche Dinge gleich griffbereit zu haben. Auch die Farbe gefällt mir sehr gut und ist zeitlos.','afe8ff7f-30a9-43ef-81bb-fa6f2eb4','2023-03-28 10:52:41',0,5,'2023-03-28 08:52:41'),('154c9fc615a00df07dbb43be51b2fd32',0,'6508e3196d3af579c4a75de4fa08cece','oxarticle','Tolles T-Shirt, tolle Farbe!','f0d30788-b058-45b3-ac6b-ccbc0c90','2023-03-29 09:12:06',0,5,'2023-03-29 07:12:06'),('1595527db17e21832a0c87dd6a92be29',0,'4924294afb5b4860e3a4625108ca29f5','oxarticle','Warum nur eine Farbe im Angebot???','88b93323-2543-45f6-b1f1-4e971484','2023-03-31 15:49:15',0,0,'2023-03-31 13:49:15'),('1878f4d9b2a3ae7980466d77f237a33a',0,'10cc6c01da168fa86c1dc16fd1effb69','oxarticle','Tolle Tasche! Anfangs war ich skeptisch, dass sie mir zu bunt sein könnte, doch sie sieht super aus. Stern Abzüge gibt es für die Qualität, da an manchen Stellen sich der Stoff schnell abgenutzt hat.','6e2b1281-0094-4342-889e-54df7e8d','2023-03-29 15:27:59',0,2,'2023-03-29 13:27:59'),('1df20cb81897ce0621642849fa8e2f7b',0,'22007e30fe1e3df513b9ac70527a2cd8','oxarticle','Sieht sehr gut an meinem Auto aus. Gefällt mir','db1690fd-33ad-41c5-85c6-d3c9abff','2023-03-30 14:57:40',0,4,'2023-03-30 12:57:40'),('1e762bb1d7035782833e145b89401dcc',0,'3832fac1df78d01c97717a003ef42456','oxarticle','A great t-shirt! I am in love with the color as it goes with 